INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (7,45,'B410','Abstract Algebra I','(Prerequisite: Grade of �C� or better in MATH B230 and MATH B300) An introduction to algebraic structures. Introduction to group theory including subgroups, quotient groups, homomorphisms; introduction to rings including ideals, quotient rings, polynomial rings and fields of fractions. Offered Spring semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (8,45,'B410','Abstract Algebra II','(Prerequisite: Grade of �C� or better in MATH B410) A continuation of studies in Algebra. An introduction to modules and field theory including vector spaces, algebras and free abelian groups; introduction to field theory including algebraic extension, Galois theory and finite fields.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (9,1,'B345','Accounting Information Systems','(Prerequisite: Grade of �C� or higher in ACCT B226) Accounting systems for business decision-making and effective control of the business enterprise.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (10,24,'B632','Action Research for Lit Edu','Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students, identifying research-based interventions, designing and implementing a coaching plan including identification of assessment to document effectiveness of plan, and assessing effectiveness of coaching plan.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (11,24,'B645','Action Research for Literacy','Candidates will gain the skills to create, manage and evaluate school-wide reading programs. This includes learning adult learning theories, developing professional learning opportunities, and supervising the literacy program.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (12,26,'B432','Adolescent Literature & Devel','(Prerequisite: ENGL B101 or B105 & B102 or B106, and one literature course at the 200-level or higher, each with a grade of ''C'' or higher) Literature written for and about adolescents, examined through the critical lenses of psychological development, pedagogy, and publishing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (13,51,'B326','Adult Health Nursing I','(Prerequisite: NURS B202, B202C, B310 and B312) Nursing management of adult and older adult patients with acute and chronic conditions is introduced. Students will synthesize previous courses to link nursing concepts, physical examination and pharmacology as part of the care management plan. As disease processes by body system are examined in greater depth, students will study disease staging, complex therapeutics and technology usage, and anticipatory complications. Stigma, ethics, and discharge from one setting to another across the care continuum are presented as advanced challenges to intervention and outcome management.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (14,51,'B425','Adult Health Nursing II','(Prerequisite: NURS B412, B418, B422C) This course will present advanced concepts in the care of high acuity and critically ill adult and elderly patients often seen in the intensive care setting. Cases analyzed will deal with high acuity illnesses, multi-systems failure, trauma, field-based communications and medical transfers. Technology to monitor, evaluate, and sustain life will be reviewed. Emphasis will be placed on Interprofessional collaboration to optimize care in the high acuity adult as well as adult palliative care and end-of-life care. Students will build confidence in rapid responses to dynamic changes in patient conditions and response. The psycho-social-support aspects of assisting families through highly vulnerable situations will be refined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (15,60,'B302','Adv Composition and Grammar','(Prerequisite: Grade of �C� or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department consent required for transfer students.) Advanced practice of reading and writing in Spanish with an intensive review of Spanish grammar.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (16,29,'B301','Adv Conversation and Grammar','(Prerequisite: FREN B202 or equivalent or consent of instructor; FREN B201 strongly recommended) Current issues and events presented in French language media. Discussion and presentations in French provide practice with advanced structures and idiomatic speech.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (17,60,'B301','Adv Conversation and Grammar','(Prerequisite: Grade of �C� or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department consent required for transfer students.) Advanced practice of speaking and listening in Spanish with an intensive review of Spanish grammar.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (18,60,'B417','Adv Span for Bus and Professns','(Prerequisite: SPAN B316 or consent of instructor) Vocabulary, concepts and oral/written skills necessary to communicate effectively in the social, cultural, or economic infrastructure of Hispanic countries. Introduction to the use of technology for the acquisition and processing of materials relevant to students� professional goals. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (19,1,'B437','Advanced Accounting','(Prerequisite: a grade of C or better in ACCT B426) The detailed study of special advanced topics of accounting, including (1) accounting for business mergers and consolidations, subsequent activities and consolidated reporting of financial information, (2) tax topics for business combinations, (3) relevant International Financial Reporting Standards, (4) accounting for legal reorganizations and liquidations, and (5) accounting for partnership formations, operations, and terminations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (20,6,'B420','Advanced Ceramics','(Prerequisite: ARTS B102, B103, B104, B111, and B321) Further development of throwing and hand-building skills. Introduction to kiln firing and continued glaze and clay experimentation. Can be repeated for a total of 6 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (21,37,'B485','Advanced Club Management','(Prerequisite. HRTM B285 or consent of instructor) Advanced topics in hospitality management for the club industry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (22,29,'B302','Advanced Comp and Grammar','(Prerequisite: FREN B201 or equivalent or consent of instructor; FREN B202 strongly recommended) Practice in French composition; intensive review of French grammar.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (23,6,'B465','Advanced Digital Photography','(Prerequisite: ARTS B102, B103, B104, B111, and B364) This course will focus on individual development in photography. Can be repeated for a total of 6 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (24,9,'B395','Advanced Directed Studies Biol','(Prerequisite: One course from BIOL B301, B302 or B303 with a grade of �C� or better) Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credit hours.',1,4);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (25,6,'B370','Advanced Drawing','(Prerequisite: ARTS B102, B103, B104, B111, and B330) Execution of advanced techniques in drawing utilizing emerging and contemporary practices. Emphasis on personal expression. Can be repeated for a total of 6 credit hours',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (26,6,'B431','Advanced Drawing II','(Prerequisite: ARTS B102, B013, B104, B111, and B430) Development of highly individualized content in a series of drawings.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (27,23,'B635','Advanced Educational Psych','(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights into defining and solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teacher�s own personal experience or from cases in the readings.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (28,56,'B498','Advanced Independent Study','(Prerequisite: 9 hours of psychology and consent of instructor) Closely supervised project or research experience in psychology. Approved contract required. May be repeated for up to six credits.',1,6);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (29,6,'B412','Advanced Painting','(Prerequisite: ARTS B102, B103, B104, B111, and B311) An advanced opportunity to develop according to one''s interests. Can be repeated for a total of 6 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (30,6,'B417','Advanced Printmaking','(Prerequisite: ARTS B102, B103, B104, B111, and B316) The processes and materials of making fine prints. Can be repeated for a total of 6 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (31,56,'B494','Advanced Research Methods Psyc','(Prerequisite: PSYC B200 and [PSYC B202 or SOCY B220 or STAT B201]) This course provides an integration of research methods and statistical methods. Students will design and complete a psychology research project.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (32,6,'B427','Advanced Sculpture','(Prerequisite: ARTS B102, B103, B014, B111, and B325) This course will focus on individual development in the form of sculpture. Can be repeated for a total of 6 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (33,13,'B501','Advanced Statistical Methods','{�STAT B501} (Prerequisite: STAT B340 [or demonstrated equivalent knowledge/experience] or consent of instructor) Methods of data description and analysis, regression and spectral techniques, graphical presentation, estimation and forecasting. Statistical software will be used throughout the course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (34,13,'B520','Advanced Topics Database Sys','(Prerequisite: CSCI B320 [or demonstrated equivalent knowledge/experience], or consent of instructor) Advanced data-processing techniques, software, database design, implementation, and manipulation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (35,26,'B460','Advanced Writing','(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher.) Upper-division writing workshop course, focusing on the study and practice of professional writing. Course may be taken twice for credit.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (36,52,'B107','Aerobic Fitness','Participate in aerobic fitness activities designed to improve cardiovascular endurance. Includes aerobic fitness assessment along with individualized and group aerobic fitness training.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (37,33,'B352','Africa from 1880','A history of modern Africa from the time of the Imperialist �scramble� of the 1880s to nationalism and decolonization in the present.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (38,26,'B428','African-American Literature','Representative works of African-American writers.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (39,33,'B309','Age of Renaissance','Social, cultural, and artistic movements in Italy and northern Europe from the Black Death (c. 1350) to religious reforms and revolutions (c. 1520).',3,NULL);
