INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (41,40,'B146','Algorithmic Design II','{�CSCI B146} (Prerequisite: CSCI/ISAT B145) Continuation of CSCI/ISAT B145. Rigorous development of algorithms and computer programs; elementary data structures. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (42,13,'B146','Algorithmic Design II','{�ISAT B146} (Prerequisite: CSCI/ISAT B145) Continuation of CSCI/ISAT B145. Rigorous development of algorithms and computer programs; elementary data structures. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (43,33,'B469','American Legal History','(Prerequisite: One of the following: HIST B101, B102, B111, B112, B115, B116. HIST B111 or B112 is preferred) A survey in American legal history, themes will include but are not confined to constitutional law, the impact of industrialism and the internationalization of law in the 20th century. Course includes REACH Act �Founding Documents�.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (44,26,'B287','American Literature','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of American literatures; authors, genres and periods. Appropriate for students from any discipline.',3,NULL);
