INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (50,45,'B450','Analysis I','(Prerequisite: grade of �C� or better in MATH B300 or consent of instructor) A rigorous treatment of topics introduced in elementary calculus and more advanced topics basic to the study of real analysis. Offered Spring semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (51,45,'B451','Analysis II','(Prerequisite: grade of �C� or better in MATH B450 or consent of department) An introduction to the theory of several variables calculus: convergence in Euclidean spaces, functions on Euclidean spaces, differentiation in several variables, integration in several variables.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (52,9,'B232','Anatomy','Functional anatomy of the human body and its relation to disease processes. Not for biology major credit. Three lecture and three laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (53,3,'B352','Anth of Magic and Religion','{�RELG B360} A comparative examination of such topics as ritual, cosmology, revitalization movements, magic, witchcraft, myth and possession. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (54,3,'B344','Anthropology of Tourism','Drawing on tourism destinations, development agendas, and societies from around the globe, this course will critically examine the relationship between tourism and cultural identities and economies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (55,56,'B212','Applied Psychology','The application of psychological principles and techniques in applied contexts such as clinical, health, forensic, educational, industrial/organizational, sport, environmental, community, and counseling psychology.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (56,59,'B314','Applied Sociology','(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the uses of sociological concepts, skills and tools to actively analyze and engage problems facing a variety of clients and organizations including business, government, religion and other community agencies and groups. Emphasizes case studies and hands-on experience to identify, investigate and actively seek solutions to issues of structure, process and social change.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (57,11,'B325','Argumentation and Debate','(Prerequisite: COMM B140) Major focus on models of argument and how they are presented in various communication contexts. Student debating included.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (58,18,'B330','Arts in Elementary Education','(Prerequisite or Co-requisite: EDCI B100) Provides opportunities to develop competence in selecting and using a variety of high quality instructional methods, resources, and assessment strategies for teaching art, music, and movement to elementary children.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (59,63,'B303','Asian Theaters','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher) A survey of the theatrical genres and practices of Japan, China, Indonesia, and India.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (60,24,'B624','Assessment & Instructional','(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (61,51,'B312','Assessment & Physical Exam','(Prerequisite: Acceptance to the Pre-licensure program, RN licensure or consent of instructor) Students will conduct a systematic patient examination to determine the health, health risk, and health alterations from disease conditions. The focus is on adults with normal physiologic variation and extends to include age, gender, and socio-cultural variants. Using assessment findings students will derive clinical problem statements, determine risk reduction strategies, and align assessment findings with laboratory and other diagnostic results to create a comprehensive health profile.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (62,24,'B425','Assessment Lit for ECE Teacher','(Prerequisite: Admission to the Professional Program in Education or consent of the Department Chair, and EDCI B100, EDCI B243, and EDRD B318; Corequisite: EDRD B430 or B433, and EDRD B450P) This course instructs teacher candidates to administer and analyze a variety of formal and informal assessments for screening and diagnosis of reading problems at the early childhood and elementary level. The course utilizes both standardized and portfolio assessments. Offered in Spring.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (63,24,'B625','Assessment Strategies for Read','Teachers will examine various types of assessments that will determine students� strengths and areas for further instruction. Teachers will analyze existing data from multiple levels: individual students, groups of students (class level), grade levels, school, district, state, and national level data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (64,1,'B485','Auditing','(Prerequisites: ACCT B426, STAT B201) Principles of auditing necessary to evaluate the integrity of accounting systems and financial reporting.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (65,9,'B431','Bacteriology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Co-requisite BIOL B431L) An introduction to bacteria and viruses emphasizing ultrastructure, physiology, genetics and growth. Discussion of public health, industrial and environmental microbiology. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (66,9,'B431L','Bacteriology Laboratory','(Co-requisite: BIOL B431) Three laboratory hours per week.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (67,45,'B221','Basic Concpt  Elementary Mth I','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or B115) The meaning of number, fundamental operations of arithmetic, the structure of the real number system and its subsystems, elementary number theory. Open only to students in elementary or early childhood teacher certification. Offered every semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (68,45,'B222','Basic Concpt Elementary Mth II','(Prerequisite: MATH B221) Informal geometry and basic concepts of algebra. Open only to students in elementary or early childhood teacher certification. Offered every semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (69,6,'B112','Basic Drawing II','Introduction to the materials and basic techniques of drawing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (70,57,'B101','Basic Health','This course is a basic health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the health field will be explored.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (71,36,'B101','Basic Health','This course is a basic personal health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the health field explored.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (72,52,'B112','Basketball','Fundamental skills of game performance. Strategy, rules, and basic offenses and defenses.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (73,29,'B101','Beginning French I','(Admission is restricted to those who have never studied French, or who have not studied French in the previous five years, or who test into this course in the USCB placement exam.) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (74,29,'B102','Beginning French II','(Prerequisite: FREN B101 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3,NULL);
