INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (77,60,'B101','Beginning Spanish I','(Admission is restricted to those who have never studied Spanish previously or who have placed by examination into 101) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (78,60,'B102','Beginning Spanish II','(Prerequisite: SPAN B101 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.',3,NULL);
