INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (80,38,'B351','Beyond the Classroom I','(Prerequisite: IDST major or approval of instructor. Junior standing.) Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university, with emphasis on community outreach.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (81,42,'B351','Beyond the Classroom I','Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university, with emphasis on community outreach.  Pre-requisite:  LBST major or approval of instructor. Junior standing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (82,58,'B111','Biblical History and Literatur','A brief introduction to contemporary study of the Bible, its historical background, writing and transmission, its principal persons, events and ideas and their significance for the present time.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (83,53,'B312','Bioethics','The concepts of Person and Justice as they relate to biomedical sciences and technologies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (84,9,'B450','Biological Oceanography','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Capstone course for the Marine Biology degree program that is an interdisciplinary introduction to biological oceanography. The course integrates physical, chemical, geological and biological principles into an overview of oceanic processes, with an emphasis on the influence of organisms on biogeochemical cycles. 3-50 minute lectures and 2.8-hour laboratory each week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (85,9,'B101','Biological Principles I','Introductory survey of cell structure and function, genetics and evolution. For biology majors, premed students and others needing a prerequisite in biological sciences. Three lecture hours and three laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (86,9,'B102','Biological Principles II','Introductory survey of plant and animal systems, principles of development, physiology, reproduction and ecology. Three lecture hours and three laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (87,56,'B361','Biological Psychology','(Prerequisite: PSYC B101) The neurochemical and neuroanatomical bases of behavior ranging from the reflex to schizophrenia. Satisfies 3-credit hour course requirement for Natural Science GE.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (88,9,'B498','Biological Research:An Intro','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Methodologies of biological research with emphasis on hypothesis formation, research design and data collection and current issues in biology. Two lecture and six laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (89,9,'B100H','Biology Honors Seminar','(Prerequisite: Acceptance in the Biology Honors program) This seminar will be an introduction to topics, information, reading and class field trips to reflect the honor�s experience in the first two years of the program. Topics covered will include common readings, discussion of current research topics or current events, and professional development of the student. Course can be repeated for up to 4 credits.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (90,9,'B411','Biology of Marine Organisms','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (91,51,'B310','Biophysical Pathology','(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor). Building on prior science courses, this course advances knowledge of pathophysiology by analyzing the molecular, cellular and organ system changes that occur with common diseases, noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (92,33,'B415','Black Americans','A survey of the historical development of black people in the Western Hemisphere.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (93,52,'B113','Bowling','An Introduction to the fundamentals of bowling, with an emphasis on basic techniques in all facets of the game, as well as an understanding of terminology.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (94,26,'B411','British Romantic Literature','Poetry and prose of the English Romantic period.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (95,44,'B250','Broadcast Design 1','Introduction to the design and production of media for documentary style broadcasting, including storyboarding, virtual sets, digital cinematography, video editing, and motion graphics.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (96,57,'B423','Busi & Prac of Personal Train','(Prerequisite: Grade of B or better in PUBH B323) The continuation of PUBH B323, this practical course surveys the skills and knowledge required for success in the field of personal training. Following National Academy of Sports Medicine guidelines, the kinesiology and physiology of human performance and the effective development of a personal training enterprise are investigated.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (97,8,'B345','Business Communications','(Prerequisite: grade of �C� or better in ENGL B102) A study of effective methods of business communications including written, oral, electronic and organizational communication.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (98,8,'B379','Business Ethics','(Prerequisite: Junior standing) A study of the values and ethics in business, business and government relations, corporate social performance and stakeholder responsibility. Social, economic, political, technological and ecological dimensions of the external environment will be integrated.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (99,8,'B363','Business Finance','(Prerequisite: ACCT B226) The study of the procurement, management, and analysis of the financial wealth and resources of profit-seeking firms.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (100,8,'B396','Business Research Methods','(Prerequisites: STAT B201 and MKTG B350) Focus is on the acquisition, use and evaluation of information from a manager�s perspective. The course will include problem diagnosis, research design, questionnaire preparation, sampling plans and the collection, analysis and interpretation of data as an aid to effective and efficient managerial decisions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (101,60,'B316','Business Spanish','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of �C� or better in SPAN B301 or SPAN B302, or consent of instructor. Department consent required for transfer students.) Commercial organizations and business in Spanish-speaking countries, business correspondence, terminology and techniques in commercial transactions. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (102,26,'B463','Business Writing','(Prerequisite: ENGL B101 or B105 and ENGL B102 or B106, each with a grade of C or higher) Advanced practice in the skills needed for effective workplace writing, with a focus on leading teams of writers, professional editing skills, and managing writing projects in a range of workplaces.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (103,45,'B122','Calculus for Business Adm SSci','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or consent) Derivatives and integrals of elementary algebraic, exponential and logarithmic functions. Maxima, minima, rate of change, and area under a curve. Applications include marginality and elasticity of demand. Offered every semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (104,45,'B141','Calculus I','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B115) Introduction to fundamental concepts and theorems of limits, continuity, and derivatives; rates of change; differentiation rules for algebraic and transcendental functions, including the chain rule; applications of derivatives; introduction to integration, including the Fundamental Theorem of Calculus and u-substitution; areas between curves. Offered every semester.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (105,45,'B142','Calculus II','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B141) Techniques of integration, applications of the integral, L�Hospital�s Rule, improper integrals; sequences and series of real numbers, power and Taylor series, introduction to polar coordinates. Offered every semester.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (106,45,'B240','Calculus III','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B142) Parametric equations, polar coordinates, three dimensional analytic geometry, cylindrical and spherical coordinates, vector functions, functions of several variables, partial differentiation, max-min, Lagrange multipliers, multiple integrals and applications, integral vector calculus. Offered Spring semester.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (107,24,'B650','Capstone: Literacy Coaching','This course is the culmination of the M.Ed. program and focuses on bringing together all of the South Carolina Literacy Competencies for Reading Coaches (SCDE, 2015). Candidates discuss presentations by various literacy specialists and exemplary literacy coaches, evaluate a variety of literacy programs, materials, and assessments, and prepare a professional portfolio.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (108,51,'B441','Capstone: Prof Nurs Project','(Prerequisite: All other RN-BSN nursing courses). The student will identify a project that synthesizes professional nursing curriculum theory and principal threads of Assessment, Critical thinking, Emotional Intelligence, Care Coordination and Cultural competence. The student will investigate a professional nursing issue, plan a project individualized to the student�s interests and develop a learning contract for a project is identified, planned and implemented that focuses on a professional nursing issue. The student will use curriculum threads of Assessment, Critical thinking, Emotional Intelligence, Care Coordination and Cultural competence to complete this clinical experience. (Seminar 2 hours, Clinical Experience 9 hours).',5,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (109,51,'B326','Care of Adults with Acute & Ch','(Prerequisite: NURS B202, B202C, B310 and B312) Nursing management of adult and older adult patients with acute and chronic conditions is introduced. Students will synthesize previous courses to link nursing concepts, physical examination and pharmacology as part of the care management plan. As disease processes by body system are examined in greater depth, students will study disease staging, complex therapeutics and technology usage, and anticipatory complications. Stigma, ethics, and discharge from one setting to another across the care continuum are presented as advanced challenges to intervention and outcome management.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (110,51,'B356','Care of Childbearing Families','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B358) This course addresses the primary and preventive care provided to childbearing families. The needs of reproducing families to ensure safe pre-, intra-, and postnatal outcomes are addressed to ensure growth and functioning in the family unit. Male reproductive and female gynecological norms and abnormalities, along with complications of pregnancy, are contrasted. Psychosocial adaptations and special needs of the family unit are studied to manage grief and loss, palliative care and women�s and men�s reproductive health challenges.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (111,51,'B358','Care of Children','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356) The developmental, physiologic, cognitive, and health needs of children are presented. Children with acute and chronic health conditions, genetic abnormalities, and infectious diseases are studied with attention to how children respond to and adapt to disease and how disease prevention is addressed. Special attention is given to rapid and accurate assessment, availability of specialized health providers and equipment, and rapid transfer of pediatric patients during life-threatening emergencies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (112,51,'B425','Care of High Acuity Adults/Eld','(Prerequisite: NURS B412, B418, B422C) This course will present advanced concepts in the care of high acuity and critically ill adult and elderly patients often seen in the intensive care setting. Cases analyzed will deal with high acuity illnesses, multi-systems failure, trauma, field-based communications and medical transfers. Technology to monitor, evaluate, and sustain life will be reviewed. Emphasis will be placed on Interprofessional collaboration to optimize care in the high acuity adult as well as adult palliative care and end-of-life care. Students will build confidence in rapid responses to dynamic changes in patient conditions and response. The psycho-social-support aspects of assisting families through highly vulnerable situations will be refined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (113,51,'B412','Care of Indiv with Mental & Ad','(Prerequisite: NURS B320 and NURS B350; Pre or Co-requisite: NURS B360) This course focuses on the epidemiology and treatment of individuals with actue and chronic mental and addiction disorders across the lifespan. Bio-physical, genetic and environmental predisposition to these conditions are examined. Pharmacologic approaches are reviewed, with emphasis on maintaining drug therapy and alleviating side effects. Cognitive approaches to helping patients and families manage anxiety, fear, and self-doubt are addressed.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (114,64,'B250','Career and Life Planning','This course will aid in development of career and life-planning skills through exposure to self-assessment, occupational information, job search techniques, professional literature, experiential education, values clarification, and career ladder strategies.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (115,51,'B435','Career Prep & Transitions','(Prerequisite: NURS B412, B418, & B422C) Students will prepare a personalized career plan that is consistent with an intentional career focus. Documents needed to apply for licensure, jobs, and continuing education will be developed and refined. Interviewing skills needed for applying for jobs and graduate level education are rehearsed. The use of social media in job procurement is presented. Readiness for NCLEX-RN� and achievement of licensure will be emphasized.',2,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (116,37,'B390','Careers in Hospitality/Tourism','(Prerequisite: Junior standing) Career options concurrent with the placement process.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (117,37,'B372','Catering Management','Management techniques, including planning, production and performance of off-premise catering.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (118,9,'B302L','Cell and Molecular Bio Lab','(Prerequisite or Co-requisite: BIOL B302) Experiments, exercises and demonstrations. Three lab hours per week',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (119,9,'B302','Cell and Molecular Biology','(Prerequisite: a grade of �C� or better BIOL B102) Principles of eukaryotic cell structure, molecular organization and physiology. Genome organization and expression. Cell growth, division and cell-cell interactions. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (120,6,'B220','Ceramics I','(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to the materials and techniques of ceramics focused on hand-building with an introduction to wheel throwing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (121,6,'B320','Ceramics II','(Prerequisite: ARTS B102, B103, B104, B111, and B220) The execution of ceramic forms with a focus on wheel throwing, firing, and glazes. Additional emphases include design, critical evaluation of form, and advancement of technical skill.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (122,6,'B321','Ceramics III','(Prerequisite: ARTS B102, B103, B104, B111, and B320) The execution of ceramic forms with a concentration on hand-building techniques, and the formulation of glazes and clay bodies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (123,44,'B345','Character Design & Look Develo','(Prerequisite: MART B210 or B281) Advanced course on character design as a fundamental aspect of storytelling across various mediums such as animation, gaming, illustration, and film. This comprehensive course in character design and look development offers students the opportunity to explore the process of creating compelling and memorable characters from conception to completion, using industry standard tools.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (124,26,'B401','Chaucer''s Works','Chaucer�s works, with special attention to the Canterbury Tales.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (125,10,'B109','Chemistry of Living Things','(Prerequisite: MATH B111 or higher.) Chemical principles including the structure of and energy associated with matter; quantitative kinetic and equilibrium analysis of chemical and physical processes. Structure and function of biological macromolecules and the molecular basis of inheritance are surveyed. Specifically designed for non-science majors. Cannot receive credit for both CHEM B101 and B109. Three lecture, one recitation and two laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (126,51,'B358','Children''s Health Nursing','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356) The developmental, physiologic, cognitive, and health needs of children are presented. Children with acute and chronic health conditions, genetic abnormalities, and infectious diseases are studied with attention to how children respond to and adapt to disease and how disease prevention is addressed. Special attention is given to rapid and accurate assessment, availability of specialized health providers and equipment, and rapid transfer of pediatric patients during life-threatening emergencies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (127,57,'B320','Chronic Disease & Risk Reducti','(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework) The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (128,36,'B320','Chronic Disease/Risk Reduction','The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (129,63,'B472','Cinema','{�ENGL 472} (Prerequisite: ENGL B101 and ENGL B102) An investigation into the aesthetics of cinema. This course will also focus on the major genres.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (130,26,'B472','Cinema','{�THEA B472} An investigation into the aesthetics of cinema. The course will also focus on the major genres.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (131,18,'B320','Cirriculum Plan, Dev and Assmt','(Prerequisite or Co-requisite: EDCI B100) This course explores issues involved in the development and education of children including curriculum, instruction, activities, materials, grouping, grading and appropriate methods of authentic assessment, as well as analysis of standardized test results in relation to the physical, social, emotional, and cognitive development of grade 2-6 learners for optimal learning. Parental involvement, community resources and collaborative relationships with specialists are included components of this course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (132,33,'B404','Civil War and Reconstr 1860-77','The political, military and social history of the War and the reorganization which followed.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (133,51,'B202C','Clincal Care & Intro to Nursin','(Co-requisites: NURS B202, B310, B312) This course emphasizes how to perform common nursing procedures. Techniques and skill development are practiced ensuring patient confidentiality, comfort measures and pain management, dietary restrictions/ intake and output measurement, infection control, vital signs, body mechanics/safety, concepts of self-care/hygiene, mobility and transfer, basic lab collection and interpretation of lab values commonly used in practice settings.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (134,51,'B425C','Clincal Care of High Acuity Ad','(Prerequisite: NURS B326, B326C, B412, B418 & B422C. Corequisite: NURS B425) Students will have exposure to adults and elders with high acuity needs. Clinical experiences will focus on the application of knowledge and skills related to the care of a high acuity adult or elder. Emphasis will be placed on application of the nursing process to manage care and reduce risks in this population, utilization of technology to monitor rapidly changing patient needs, plan and prioritize care, anticipate patient needs and contribute to interprofessional teams collaborating care for the high acuity adult or elder.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (135,51,'B422C','Clinical Care in Public & Comm','(Prerequisite: NURS B320, B326, and B350. Corequisite: NURS B412 and B418) In conjunction with NURS B412 and NURS B418, this clinical course focuses on experiential learning in community-based or public health settings. These settings serve primary and prevention care needs of school age, mental health, addictions, or other populations. A change management project that involves priority setting, delegation, policy making, budgeting, and/or measurement of community impact is introduced. Clinical experience may also include providing community-based education, care coordination, and managing resource capacity.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (136,51,'B326C','Clinical Care of Adults w/ Acu','(Prerequisites: NURS B202, B202C, B312. Corequisite: NURS B320 & B326) Students will be exposed to adults and older adults with acute and chronic conditions. Clinical experiences will focus on the application of knowledge and skills related to the care of an adult patient. Emphasis will be placed on applying the nursing process to manage care, setting clinical priorities and using technology to anticipate patient needs as a member of interprofessional teams.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (137,51,'B360C','Clinical Care of Childbearing','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356 and NURS B358) In conjunction with NURS B358, this course blends practice/simulation laboratory experiences with clinical experiences in care settings where mothers, infants, children and family units receive care.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (138,16,'B100','Clinical Obsrvation & Analysis','(Prerequisite: Majoring in Education, Minoring in Education, or consent of instructor) Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity, instructional variety, task orientation, leaning process, student success, performance outcomes and higher thought processes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (139,16,'B210','Clinical Obsrvation & Analysis','Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity instructional variety, task orientation, leaning process, student success, and performance outcomes and higher thought processes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (140,51,'B320','Clinical Pharmacology','(Prerequisite: NURS B310 or consent of instructor) Pharmacokinetics, pharmacodynamics and pharmacogenetics are studied from a drug classification typology. The nurse�s role in verifying and validating drug prescriptions, calculating dosages, administering will build previous learning. Assisting patients with the management of side effects, drug discontinuation, and iatrogenic complications are studied. Current issues with poly-pharmaceuticals, addiction, and self-management with over-the-counter and herbal usage will be discussed from an evidence- and ethically-based practice perspective.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (141,51,'B430C','Clinical Synthesis & Seminar','(Prerequisite: NURS B412, B418 and B422C) In this clinical course, students will have an opportunity to model program outcomes and strengthen their abilities to manage a client population throughout a shift, focusing on organizational, delegation, and time management skills. Priority setting and the ability to develop focus in delivering care to more than one client are emphasized. In the seminar setting, synthesis of clinical information linked to individuals, families, and communities will be reviewed. Role understanding and clinical functioning will be evaluated to meet entry-level practice expectations. Knowledge of patient education, discharge planning, team functions, and nursing skills will be demonstrated.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (142,37,'B285','Club Management','Unique problems and issues associated with private club management.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (143,37,'B385','Club Management','Unique problems and issues associated with private club management.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (144,49,'B215','Coastal Enviroments of S.E. US','Coastal zones of South Carolina and neighboring states, including geologic history, geomorphology, stratigraphy, hydrogeology, shoreline processes, environmental issues and effect of man. Three lecture hours each week plus optional field trips. Not available for marine science major credit.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (145,49,'B215L','Coastal Environments Lab','Exercises examining coastal ecology, geomorphology, hydrogeology, shoreline processes, environmental issues and human impact. Two laboratory hours per week. Scheduled field trips required. Not available for marine science major credit.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (146,56,'B401','Cognitive Psychology','(Prerequisite: PSYC B302) Research and theories on sensory memory, attention, short-term and working memory, human learning and forgetting, imagery, long-term memory, speech perception, reading, language, thinking and problem solving and decision making.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (147,59,'B354','Collective Behavior','An analysis of crowds, publics, social movements and the mass society in terms of their institutional and social psychological consequences.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (148,45,'B111','College Algebra','(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111 and B111L. Offered every semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (149,45,'B111E','College Algebra Extension','Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. This extension lab provides supervised practice of skills necessary for proficiency in college-level algebra. Required for enrollment in MATH B111 without an appropriate score on the Mathematics Placement Exam.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (150,61,'B310','College Athletics','This course is focused on the study of college athletics and is designed to provide an overview of the administration of intercollegiate sports at multiple levels (NCAA, NAIA, Junior College) of competition. With the athletic administration of college sports serving as the primary focus of this course, students will also review the history of college sports, the role college sports play in society, and the future of sport on postsecondary campuses. Upon completion of this course, students will have also been provided with an overview of such topics as leadership and administration, personnel management/human resources, event and game management, marketing, fundraising, budgeting, academic support, and compliance with institution, conference, and association bylaws in addition to legal statutes and laws.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (151,8,'B324','Commercial Law','(Prerequisite: Junior standing) Contracts, sales, bailments, negotiable instruments, agency, partnership and corporation. A combination of textbook and casebook methods of instruction is used.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (152,60,'B202','Communication & Cultural Comp','(Prerequisite: SPAN B201, score on placement exam or consent of instructor, SPAN B202 is a continuation of SPAN B201). Review and further expansion of oral and written communication skills, reading of authentic materials and understanding of cultural and social topics, including Hispanics and Latinx in the United States. Intermediate language course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (153,11,'B400','Communication & Pop culture','(Prerequisite: Junior standing) Explores the complex relationships of language, visual images, mediated communication, and cultural values in popular culture.',3,NULL);
