INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (156,11,'B303','Communication Law','(Prerequisite: COMM B190 and COMM B240, or consent of instructor) An overview of the key areas of First Amendment law, and the important U.S. Supreme Court cases that have addressed the Constitution''s guarantee of free speech and free press.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (157,11,'B490','Communication Studies Capstone','(Prerequisite: Senior status and consent of instructor) Provides students with the opportunities to integrate the knowledge and skills they have acquired as communication studies majors as well as provide experiences for students to exhibit competent communication skills learned during their program of study.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (158,11,'B255','Communication Studies Research','An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (159,11,'B255','Communications Studies Researc','An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (194,26,'B222','Creative Writing across Curric','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Introductory level workshop designed to foster a student�s appreciation for, and ability to create brief works of adult level fiction, poetry, nonfiction, and drama. Appropriate for students from any discipline.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (195,53,'B303','Critical Social Theories','This course is an introduction to the critical social theories that have developed since the late 19th century. Critical social thought in philosophy focuses on various socio-historical conditions in contemporary society, as well as on the sociocultural methods that are used to study them. Possible frameworks may include Marxism, Neo-Marxism, feminist philosophies, queer theory, critical race theory, and post-analytic philosophy. Social and cultural topics may include race, gender, global economic dynamics, Internet culture, and social media.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (160,51,'B418','Community & Pub Health Nursing','(Prerequisite: NURS B356 and NURS B358 for pre-licensure students; NURS B350 for all nursing students; Co-requisite) Primary prevention strategies for populations at risk are emphasized to promote and protect health and prevent disease across the life span. Local, state and national health policies, political and economic influences will be part of the analysis of community issues and activities. An inter-disciplinary, collaborative approach is taken in community assessment, decision-making, planning, implementation and evaluation throughout community health nursing practice. The role and functions of agencies that deliver public health, community-based is presented. These functions include communicable disease reporting, control and management, environmental monitoring, disaster preparedness and management, the care of vulnerable populations, and public education. Community assessment and agency coordination at the local, regional, and national level is discussed. Principles of epidemiology, surveillance, environmental influences on health, strategies for dealing with public health issues will be presented in caring for populations. The place for community based and public health nursing as part of a coordinated/dis-coordinated care system at the local, regional, and national level will be examined. National and state agencies such as the CDC, DHEC and American Red Cross will serve as exemplars for the care coordination.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (161,51,'B418','Community Health Nursing','(Prerequisite: NURS B356 and NURS B358 for pre-licensure students; NURS B350 for all nursing students; Co-requisite) Primary prevention strategies for populations at risk are emphasized to promote and protect health and prevent disease across the life span. Local, state and national health policies, political and economic influences will be part of the analysis of community issues and activities. An inter-disciplinary, collaborative approach is taken in community assessment, decision-making, planning, implementation and evaluation throughout community health nursing practice. The role and functions of agencies that deliver public health, community-based is presented. These functions include communicable disease reporting, control and management, environmental monitoring, disaster preparedness and management, the care of vulnerable populations, and public education. Community assessment and agency coordination at the local, regional, and national level is discussed. Principles of epidemiology, surveillance, environmental influences on health, strategies for dealing with public health issues will be presented in caring for populations. The place for community based and public health nursing as part of a coordinated/dis-coordinated care system at the local, regional, and national level will be examined. National and state agencies such as the CDC, DHEC and American Red Cross will serve as exemplars for the care coordination.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (162,38,'B352','Community Project II','The application of theoretical foundations and service learning in a community project designed in IDST B351, implemented as individual or group project.',3,NULL);
