INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (164,56,'B415','Community Psychology','(Prerequisite: PSYC B101) Community psychology explores the roles that individuals play in the formation, resilience, and well-being of communities and, in turn, examine how communities influence the individual.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (165,40,'B499','Comp Science Co-Op/Internship','(Prerequisite: [CSCI/ISAT Majors only] and consent of instructor) Practical work experience in an area of Computer Science or IT, selected by the student and approved by the Computer Science Department Chair or ISAT Program Coordinator. For 1 credit, 45 minimum internship work hours are typically required; for 2 credits, 90 work hours; and for 3 credits, 135 work hours.',1,3);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (166,58,'B203','Comparative Religion','The religious experience of varied persons and groups, East and West, in traditional and contemporary settings. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (167,45,'B452','Complex Analysis','(Prerequisite: grade of �C� or better in MATH B240) Complex integration, calculus of residues, conformal mapping, Taylor and Laurent series expansions, applications.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (168,26,'B101','Composition','An introduction to university-level writing, emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances, create effective writing, and develop processed for composing texts for academic, civic, professional, and personal purposes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (169,26,'B101','Composition & Rhetoric','An introduction to university-level writing, emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances, create effective writing, and develop processed for composing texts for academic, civic, professional, and personal purposes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (170,26,'B102','Composition and Literature','(Prerequisite: ENGL B101 or B105, each with a grade of �C� or higher) An extension of composition skills developed in ENGL B101 and an introduction to literature, emphasizing the interpretive skills and processes necessary to read complex and imaginative texts creatively, critically, and rhetorically so students can write responses to - and interventions in - the world around them.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (171,40,'B104','Comptr Programming Techniques','{�CSCI B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (172,13,'B104','Comptr Programming Techniques','{�ISAT B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (173,13,'B280','Computational Mathematics','{�ISAT B280, MATH B280} (Prerequisite: MATH B142 and CSCI/ISAT B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and  engineering disciplines.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (174,13,'B365','Computer Graphics','{�ISAT B365} (Prerequisite: [MATH B230 or CSCI/MATH B280] and CSCI B240 or consent of instructor) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (175,47,'B290','Computer Info Systems in Bus','Concepts and techniques of business problem solving using microcomputers. Introduction to the PC operating environment, basic information system concepts and spreadsheet, presentation, database and word processing software.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (176,40,'B207','Computer System Administration','{�CSCI B207} (Prerequisite: CSCI/ISAT B104 and CSCI/ISAT B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (177,13,'B104','Computing in Matlab','{�ISAT B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (178,51,'B105','Concepts, Comm, Calculations','This course introduces concepts essential to basic nursing practice. Nursing''s historical evolution as a profession through theory, concept and role development will be presented. An overview of medical terminology and medical calculations is provided as skills that promote patient safety within the health disciplines. Written communication skills for the professional nurse will be presented. Students will be introduced to the difference between scholarly and non-scholarly sources.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (179,37,'B364','Conference and Mtg Planning','(Prerequisite: HRTM B260) Planning and managing conferences and meetings in the tourism industry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (180,53,'B212','Conflicting Images of Man','This course investigates particular interpretations of human nature that have arisen within the history of ideas. Particular focus will be given to 1) analyzing the conflicting claims regarding human behavior that arise from such interpretations and 2) evaluating disagreements regarding the norms of conduct and social policy that develop from these different interpretations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (181,9,'B471','Conservation Biology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Synthesis of current scientific trends in conservation biology. Emphasis will be placed on the preservation of biological diversity as well as its evolutionary potential. Laboratory/Seminar will review scientific literature and introduce modern molecular techniques in conservation biology and computer simulation modeling.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (182,48,'B455','Consumer Behavior','(Prerequisite: MKTG B350) The principal objective of study is the consumer decision process as examined in a marketing context. Selected concepts from psychology, sociology, anthropology and behavioral disciplines are analyzed to develop the student''s ability to understand and predict reactions of consumers to marketing decisions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (183,3,'B312','Contemp Cross-Cult Analysis','An examination of conformity, conflict or stability, of human interactions across cultural boundaries both at home and abroad, the positive and negative consequences of increasing global interconnectedness and the role of culture change, ethnic identity or religious unity in creating contradictory social and political trends. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (184,33,'B317','Contemp Euro World War I to II','The Great War, revolution and reconstruction; the rise of authoritarian and totalitarian regimes and the coming of World War II.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (185,26,'B426','Contemporary American Lit','Poetry and prose from 1945 to present.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (186,8,'B101','Contemporary Business','The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management, marketing, finance and accounting will be integrated into the course. A topical survey of business issues and challenges.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (187,53,'B211','Contemporary Moral Issues','Moral issues confronting men and women in contemporary society. Topics will vary but may include discussion of problems related to abortion, drugs, euthanasia, war, social engineering and punishment of criminals.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (188,51,'B301','Contemporary Pro Nursing Pract','(Prerequisite: Major in RN to BSN or Permission of Instructor) This course focuses on the evolution of nursing as a practice profession and discipline, and the ways of knowing in nursing. Students are introduced to nursing theories that guide practice as well as current and emerging nursing roles in today�s complex healthcare environment. Emphasis is placed on the role of professional nursing in the interprofessional team and professional nursing�s influence on health outcomes to improve the population�s health.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (189,24,'B629','Content Area Reading & Writing','After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text, teachers will apply what they have learned to their own disciplines, creating strategies that will support students in reading and writing within the context of content area instruction.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (190,24,'B429','Content Literacy for Sec Teach','(Prerequisite: EDCI B100; admissions to a secondary teaching program, or special permission of the Department Chair of Education) This course provides 7-12 teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (191,24,'B419','Content Literacy for Secondary','This course provides 7-12 grade teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (192,55,'B111','Controv in American Politics','An introduction to the analysis of key issues in contemporary American politics focusing on the arguments, the groups involved and the political factors that influence the outcome of the debate.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (193,1,'B355','Cost Accounting','(Prerequisite: Grade of �C� or higher in ACCT B226) Preparation, critical analysis and use of management accounting information for purposes of strategic decision making, planning and control and performance measurement and evaluation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (196,37,'B301','Cruise Line Management','An overview of the cruise line industry, its organization, impacts upon ports of call and destinations, and the skills needed to begin a productive career in this specialized travel.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (197,40,'B455','Cryptography','(Prerequisite: CSCI/ISAT B201, CSCI/ISAT B416, MATH B141, STAT B201 or B240 or B340, or consent of instructor.) Cryptography, secure encryption protocols, and the essential mathematics underlying encryption. Number theory, symmetric and asymmetric ciphers, hash functions, key management and distribution. Transport-level security and other forms of network and Internet security.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (198,16,'B322','Cultural Diversity in Educ','This course prepares students to demonstrate an understanding of the depth and breadth of cultural diversity within the United States, as well as the ways that the intersections of cultures within the classroom shape teaching and learning outcomes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (199,56,'B380','Cultural Psychology','(Prerequisite: PSYC B101) A global cultural perspective on human behavior exploring how culture influences our lives and the lives of others across the world. Topics may include cultural influences on development, mental health, cognition, personality and social behavior.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (200,37,'B410A','Current Issues','(Prerequisite: Senior standing) Issues and problems concerning the hospitality industry.',3,NULL);
