INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (203,17,'B342','Curriculum Plan and Dev in ECE','(Prerequisite or Co-requisites: EDCI B100; EDEC B340; EDPY B335). This curriculum course is designed for prospective teachers in the nursery, kindergarten and primary schools. The course explores various issues involved in the development and education of children from the ages of four to eight. Attention is given to learning activities, materials and equipment suitable for teaching at this level. Emphasis is given to appropriate methods for assessment of children ages four through eight and to the relationship of various subject areas to the physical, social, emotional and cognitive development of the child. Philosophy, history of early childhood education, classroom management, societal influences, parental involvement and community resources are included.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (204,16,'B320','Curriculum Planning,Technology','(Prerequisite or Corequisite: EDCI B100) Explores issues of development and education of adolescents including curriculum, instruction, activities, materials, and authentic assessment. Prospective teachers will understand the importance of differentiation and technology integration at all levels of instruction and assessment. Parental involvement, community resources, and collaborative relationships with specialists are included components of this course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (205,13,'B516','Data Communications & Networks','(Prerequisite: undergraduate programming experience or CSCI B500 or consent of instructor) Advanced topics in data communications, architecture, communication protocols, topologies, network access control, LANs, MANs, and WANs; internetworking.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (206,13,'B522','Data Mining','(Prerequisite: CSCI B501 and CSCI B502 [or demonstrated equivalent knowledge/experience]) Concepts, issues, tasks and techniques of data mining. Topics include data preparation, feature abstraction, association, classification, clustering, evaluation and validation, scalability, spatial and sequence mining, and data mining applications.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (207,13,'B466','Data Visualization','(Prerequisite: STAT B240 or STAT B340 or STAT B201 (for business major students) or consent) Principles, methods, and concepts required to visualize data and statistics; various design issues that arise when assembling data visualizations including aesthetic aspects.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (208,13,'B566','Data Visualization','(Corequisite: CSCI B501 and CSCI B502 or consent of instructor) Advanced techniques and algorithms for creating effective visualizations based on principles from graphic design, visual art, perceptual psychology, and cognitive science.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (209,40,'B420','Database Mgmt Systems II','{�CSCI B420} (Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (210,13,'B320','Database Systems and Mgmt','{�ISAT B320} (Prerequisite: CSCI/ISAT B104) Provides foundations of relational database systems for students with little prior database experience. Topics include: common relational database platforms; data design,  normalization, and modeling with emphasis on confidentiality, availability, and integrity; data definition, manipulation, and control using Structured Query Language (SQL).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (211,40,'B321','Database-Driven Application Dv','{�CSCI B321}  (Prerequisite: CSCI/ISAT B145 and CSCI/ISAT B320) This course introduces students to database-driven multi-tier application development concepts, techniques, practices, and tools. Topics include: database design and integration; server-side programming; user interface design; human-centered design; iterative development; and application security.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (212,13,'B321','Database-Driven Application Dv','{�ISAT B321}  (Prerequisite: CSCI/ISAT B145 and CSCI/ISAT B320) This course introduces students to database-driven multi-tier application development concepts, techniques, practices, and tools. Topics include: database design and integration; server-side programming; user interface design; human-centered design; iterative development; and application security.',3,NULL);
