INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (214,51,'B202','Decision Making in Conc Based','(For the pre-licensure track: Prerequisite: Acceptance as a pre-licensure BSN student; Co-requisite: NURS B310 and NURS B312) The nursing process as a problem-solving framework is introduced to identify, treat, evaluate and document clinical problems in health records. Emphasis is placed on patient and family-centered therapeutic communication as an adjunct to assessment and evaluation. Selected universal concepts reflecting the holistic nature of caregiving across settings are presented to advance critical thinking.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (215,7,'B111','Descriptive Astronomy I','(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) The universe: physical processes and methods of study. Lectures, demonstrations, and laboratory experience. Designed primarily for the non-science major.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (216,7,'B111L','Descriptive Astronomy I Lab','Selected topics from ASTR B111 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (217,7,'B211','Descriptive Astronomy II','(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) Study of Galactic Astronomy including stars, black holes and Galaxies.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (218,7,'B211L','Descriptive Astronomy II Lab','(Prerequisite or Co-requisite: ASTR B111L) Topics from ASTR B111/B211 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (219,37,'B235','Destination Marketing','The application of marketing management and best practices to Hospitality destination development. Also examined will be the structures of destination marketing organizations, funding sources, and operations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (220,26,'B453','Dev of the English Language','{�LING 431} An overview of the histories of English, from Proto-Indo-European to Present-Day English, with an emphasis on the ways that speakers of different varieties of English have shaped the language and the ways its speakers interact with one another. No previous knowledge of linguistics required.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (221,9,'B405','Developmental Biology I','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) An introduction to the fundamental principles of animal and plant embryonic and post-embryonic development using anatomical, experimental and molecular genetics approaches. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (222,9,'B405L','Developmental Biology I Lab','(Co-requisite: BIOL B405) Descriptive and experimental exercises related to embryology. One three-hour laboratory per week.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (223,24,'B623','Differentiation in Read Instr','This course requires that students conduct in-depth study of effective literacy methods, materials, and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students, including the gifted and talented, culturally and linguistically diverse learners, and children and young people with disabilities.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (224,44,'B210','Digital Animation 1','Introduction to the theory and practice of using computer software to create animated digital media, including 3D character animation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (225,44,'B310','Digital Animation 2','(Prerequisite: MART B210) Intermediate project-based course on a specialized aspect of digital animation production, including 3D modeling, character animation, or special effects.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (226,11,'B216','Digital Comm Technologies','(Prerequisite: COMM B140 or B201) This course introduces students to digital communication technologies from both a theoretical and practical framework. Students will understand how to use communication technologies to advance communication strategies to multiple audiences.',3,NULL);
