INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (241,17,'B437','Early Childhood Science Experi','(Corequisite: EDEC B440P) This course will focus on science content, including earth science, physical science, and life science for grades K-3 per the new South Carolina Science Standards (2021) and the Next Generation of Science Standards Three Dimensional Learning (3D science and engineering practices, crosscutting concepts, and disciplinary core ideas) Framework (2012). Teacher candidates will learn and implement student-centered inquiry, evidence-based methods, and lessons for teaching science to young learners, including interdisciplinary approaches in science teaching and learning.',3,NULL);
