INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (251,25,'B620','Educ Research, Design & Analy','This course provides an overview of the principles, models, and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (252,17,'B340','Education of the Young Child','(Prerequisite or Co-requisite: EDCI B100). A study of the physical, emotional, intellectual and social components of development, birth through age eight and their relationship to the education of the young child birth - age eight. Diagnosis and assessment of development are addressed. Programs serving young children and their families will be discussed. The administration of these programs as well as advocacy efforts are included. Observation and participation in early childhood settings is required.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (253,45,'B242','Elementary Differential Equatn','(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B142) Ordinary differential equations of first order, higher order linear equations, Laplace transform methods, series methods; numerical solution of differential equations. Applications to physical sciences and engineering. Offered Spring semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (254,62,'B201','Elementary Statistics','(Prerequisite: MATH B101 or higher or consent of instructor) An introductory course in the fundamentals of modern statistical methods. Topics include descriptive statistics, normal distributions, random sampling, statistical studies and ethics, probability, confidence intervals, tests of hypothesis, simple linear regression and correlation.',3,NULL);
