INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (262,26,'B105','Enhanced Composition','English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B101. An introduction to genres of writing, including (but not limited to) researched arguments.',3,NULL);
