INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (271,51,'B450','Ethical Decision-Making, Legal','(Prerequisite: NURS B202 or B301) This course examines legal and ethical issues in healthcare and how they influence health policy. Students study legal principles governing professional nursing practice and explore frameworks to support ethical decision-making across the continuum of care. The nurse''s role in healthcare policy development, implementation and analysis are explored, particularly as it relates to legal and ethical issues affecting practice. Students explore current legal/ethical issues and existing health policies, with an emphasis on how these issues impact access to, and delivery of healthcare services to vulnerable populations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (272,40,'B318','Ethical Hacking','(Prerequisite: ISAT B201) Introduction to the principles and techniques associated with the cybersecurity practice known as penetration testing or ethical hacking. The course covers planning, reconnaissance, scanning, exploitation, post-exploitation, and result reporting. The student discovers how system vulnerabilities can be exploited and learns to avoid such problems.',3,NULL);
