INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (279,45,'B101','Experiential Mathematics','(Prerequisite: Mathematics Placement Exam and two years of high school algebra or equivalent) Mathematics application and appreciation in algebra, geometry, probability and statistics. Modeling and computation in practical applications. Foundational topics are chosen from: Number and Measurement Systems, Symbolic Relationships, Data Description or Analysis, Geometry, Uncertainty, Reasoning, and the Mathematics of Finance. This course serves as a prerequisite for no other MATH courses. Offered every semester.',3,NULL);
