INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (281,11,'B390','Family Communication','A basic introduction to the study of how communication is used in the family to develop, maintain, enhance or disturb marital and family relationships.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (282,3,'B351','Family Cross-Cult Perspective','Kinship, systems of descent, marriage and domestic organization in different cultures. Variations in childrearing practices, sex roles and other aspects of social relations in kin groups. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (283,17,'B345','Family Life in Early Childhood','(Prerequisite: PSYC B209 or PSYC B321; Admission to the Professional Program in Education or consent of the Department Chair) Principles, practices and content of family life and family-school relations as related to young children�s learning and development in various settings during the early childhood years, birth through eight. This course will provide a foundation for using family life knowledge in relating to young children and families in effective ways.',3,NULL);
