INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (291,8,'B210','Financial Reasoning','The course will provide an introduction to the financial concepts and principles that support business analyses and decision making. The course will focus on important concepts such as: the time value of money, stock and bond valuations, and interest rates and return. In addition, the course will develop an understanding of financial statements and financial ratios.',3,NULL);
