INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (294,37,'B447','Food Science','(Prerequisite: HRTM B242) The effects of cooking, processing and storage of food on nutrient content, sensory perception and functionality. Two lecture and two laboratory hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (295,37,'B360','Food, Hospitality and Culture','{�PUBH B324} Cultural factors affecting food habits and population needs throughout the world.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (296,9,'B451','Forensic Tech and Data Analys','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Current application of forensic data collection, analysis and interpretation in the legal process. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (297,53,'B110','Formal Logic: Deduction & Infe','This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic, sentential logic, and predicate logic. Student will develop skills in the development and analysis of syllogisms, Venn Diagrams, truth tables, and formal proofs.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (298,20,'B321','Foundations of American Edu','Extensive treatment of social, political, economic and philosophical influences that have shaped public education. Study of the financial, organizational and legal aspects of education. Library assignments provide a working knowledge of professional standard references and journals.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (299,52,'B202','Foundations of Coaching','Explore coaching philosophies, coaching techniques, training fundamentals, risk management and group management strategies. Emphasis placed on coaching skills necessary for working with children. Includes practical experience and evaluation of coaching situations.',2,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (300,45,'B331','Foundations of Geometry','(Prerequisite: Grade of ''C'' or better in MATH B300) The study of geometry as a logical system based upon postulates and undefined terms. The fundamental concepts and relations of Euclidean geometry developed rigorously on the basis of a set of postulates. Some topics from non-Euclidean geometry. Offered Fall semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (301,24,'B318','Foundations of Reading','(Prerequisite: EDCI B100, or EDCI B243, or special permission of the Department Chair) This course focuses on the foundations of reading, including language development, phonemic awareness, phonics, vocabulary, fluency, and comprehension. Offered in Fall.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (302,24,'B619','Foundations of Reading','(Prerequisite: Permission of Department) This course provides candidates with comprehensive knowledge of the social, cultural, and linguistic factors that influence reading development. Emphasis is placed on practical application of theory, oral language development, phonemic awareness and phonics.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (303,24,'B319','Foundations of Reading Sec Tea','(Prerequisite: EDCI B100; admissions to a secondary teaching program, or special permission of the Department Chair of Education) This course provides the basics of teaching reading and writing in secondary content classes. Candidates will be prepared to support students in grades 9-12 who are struggling to read, write, and comprehend information through assessment and differentiation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (304,1,'B325','Fraud Examination','(Prerequisite: ACCT B226) An overview of the different types of fraud, how and why they are committed, and the methodology for investigating and resolving allegations of fraud. Special emphasis is placed on detection and deterrence.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (305,29,'B290','French Lit in Translation','Readings and discussion in English, with consideration of the cultural context.',3,NULL);
