INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (394,46,'B374','Human Resource Management','(Prerequisite: MGMT B371) A development of an understanding of personnel administration as a staff function through a study of modern-day concepts and practices. Topics include: research and standards, employment, training and education, safety and health, employee services and industrial relations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (395,37,'B451','Human Resources in HRTM','(Prerequisites: HRTM B110 and B230) A specialized approach to human resources management in the hospitality industry. Students will analyze contemporary issues and practices, as well as the trends that transform the way people are managed specifically within the hospitality industry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (396,34,'B300','Human Service Interventions II','(Prerequisite or co-requisite: HMSV B280 or consent of Instructor) Exploration of the theories, skills and practices of working with larger groups in human service settings such as grassroots or formal organizations, neighborhoods, communities, geographic regions, political jurisdictions, and societies. Includes community organizing and development, agency collaborations, social change, social marketing and public awareness, advocacy and social policy work. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (397,34,'B302','Human Services Evaluation','(Prerequisite: HMSV B280, or consent of Instructor) Research methods for determining the effectiveness of social programs/interventions (i.e., experimental, quasi-experimental and qualitative designs).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (398,34,'B290','Human Services Internship I','(Prerequisite: HMSV 280 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (399,34,'B298','Human Services Internship II','(Prerequisite: HMSV 290 or consent of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship. (N.B. no more than two internship can be at the same site.)',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (400,34,'B490','Human Services Internship III','(Prerequisite: HMSV 298 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; a capstone essay that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship; and submission of a professional portfolio for review. (N.B. no more than two internship can be at the same site.)',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (401,34,'B190','Human Services: An  Intro','(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor). The intention of this course is to acquaint students with an overview of the interdisciplinary field of human services by providing a historical and contemporary survey of human service program literatures. Students will be able to identify the domain of human services as an interdisciplinary area of theory and practice. Specifically, they will be able to master concepts generic to this field of study and apply them in human service situations.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (402,56,'B214','Human Sexual Behavior','Psychological, physiological and sociological factors of human sexual behavior and attitudes.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (403,34,'B280','Human Srv Interventions I','(Prerequisite or co-requisite: HMSV B190 or consent of Instructor.) Exploration of the theories, skills and practices of working one-on one in human services settings. Includes active listening, communication skills, and interviewing techniques, the development of service plans, crisis intervention, short and long term care, case management and information and referral services. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (404,9,'B436','Ichthyology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Phylogeny, morphology, behavior, and ecology of fishes. Three lecture and three laboratory hours per week. Several field trips are required.',4,NULL);
