INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (426,51,'B399','Independent Study in Nursing','This course is an advanced study of a particular theme or topic in the nursing through readings, research, and analysis. It is designed for students who have completed basic courses and who want to study specific topics that are not offered in the curriculum or extend learning of a topic from a course already completed (i.e., develop a poster or manuscript based on a scholarly paper). A contract of study is developed through readings, projects, papers, and/or seminars approved by instructor. Up to 3 credits may be contracted and repeated for a total of 6 credits.',1,6);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (427,57,'B399','Independent Study in PUBH','(Prerequisite: PUBH B310 or consent of instructor) This course examines concepts, emerging trends, issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4 credits, depending on topic which may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits.',1,4);
