INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (444,45,'B111L','Intensive College Algebra','(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111L and B111. Offered every semester.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (445,26,'B101L','Intensive English Comp Lab','Intensive practice in English composition. Special attention devoted to thesis formation, essay structure, paragraph structure, style and mechanics.  (Students may place out of BENG 101L with a sufficiently high score on USCB�s English Placement Test.)',1,NULL);
