INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (447,44,'B381','Interactive Media 2','(Prerequisite: MART B281) Intermediate project-based course on a specialized aspect of 3D video game production, including art assets, level design, or coding events.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (448,11,'B285','Intercultural Communication','A study of cultural differences in human communication with focus on theoretical and experiential approaches toward gaining competence in communicating across cultures. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
