INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (451,38,'B250','Interdisciplinary Internship','(Prerequisite: IDST Major or Minor only, IDST B297, or consent of instructor) Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. Can be repeated once.',3,NULL);
