INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (453,1,'B425','Intermediate Accounting I','(Prerequisite: Grade of �C� or higher in ACCT B226) A detailed study of the preparation and presentation of the balance sheet, income statement, statement of retained earnings, and statement of cash flows. Includes a comprehensive analysis of financial transactions related to revenues and assets, with an emphasis on revenue recognition, and asset valuation issues.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (454,1,'B426','Intermediate Accounting II','(Prerequisite: Grade of �C� or higher in ACCT B425) A continuation of the detailed study of the preparation and presentation of financial statements. Problem solving techniques and the ability to structure problem solutions will be stressed.',3,NULL);
