INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (460,11,'B495','Internship in Comm Studies','(Prerequisite: Communication Studies Major only, 15 hours of communication studies, consent of instructor). Provides students with the opportunity to apply skills and knowledge across socially and culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. May be repeated for a maximum of 12 credit hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (461,17,'B469','Internship in ECE','(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDEC B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.',12,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (462,18,'B470','Internship in Elementary Schl','(Prerequisite: Admission to the Professional Program in Elementary Education; Co-requisite: EDEL B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.',12,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (463,36,'B480','Internship in Health Promotion','A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (464,44,'B499','Internship in Media Arts','(Prerequisite: MART B310 or B381 or permission of instructor) Supervised experience in media production facilities. Can be taken for 1-3 credits based on 50 contact hours per credit, and contract must be approved by instructor, advisor, and department head.',1,3);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (465,56,'B495','Internship in Psychology I','(Prerequisite: Psychology Majors only, 15 hours of psychology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world. Minimum requirement of 150 service hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (466,57,'B480','Internship in Public Health','(Prerequisite: PUBH B450; Co-requisite: PUBH B460) A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where public health principles are applied.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (467,59,'B495','Internship in Sociology','(Prerequisite: Sociology Majors only, 15 hours of sociology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world experience. Requires at least 150 hours of service, online reflections and a final paper that demonstrates the ability to apply theories, concepts and principles of practice.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (468,34,'B492','Internship IV','(Prerequisite: HMSV B490 and permission of instructor, and approved contract with internship agency.) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service, participation in seminars, written reflections, and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internships. (Maximum of two internships can be taken at the same site.)',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (469,21,'B469','Internship Secondary Math Edu','(Co-requisite: EDME B476) A program of observation and teaching secondary mathematics in the public schools under the supervision of university and public school personnel.',12,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (470,11,'B201','Interpersonal Communication','Presents basic concepts for understanding communication in interpersonal relationships. It combines a theoretical approach with a skills approach to the study of interpersonal communication.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (471,2,'B201','Intro African-Amer Studies I','A broad introduction to the history, culture, religion, institutions, politics, economics, arts, and psychology of people of African descent as developed from experience in both the old and new worlds.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (472,2,'B202','Intro African-Amer Studies II',NULL,3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (473,23,'B333','Intro Child Growth and Develop','Basic course designed to familiarize the prospective teacher with the patterns of social, emotional, physical and intellectual growth of the individual. Development of these growth patterns from the prenatal stage to the onset of adolescence.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (474,23,'B335','Intro Educational Psychology','(Prerequisite or Co-requisite: EDCI B100) This course will introduce pre-service teachers and education majors to psychological principles, theory and data upon which effective classroom practices are based, including general methods and techniques. A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning, evaluation and control. Emphasis will be placed on student motivation, learning problems, individual differences and measurement.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (475,9,'B270L','Intro Environmental Bio Lab','(Prerequisite or Co-requisite: BIOL B270) Demonstrations, data analyses, discussions and films relating to human ecology, resource use and environmental impact. Two hours per week. Not for major credit.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (476,9,'B270','Intro Environmental Biology','Basic ecological principles and the impacts of human population growth and technology. Not for major credit.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (477,19,'B300','Intro Exceptional Learner','(Admission to the Professional Program or consent of Department Chair). A survey of the development of special education, the current legal guidelines with emphasis on public school mandates, the various clusters of exceptionalities: their definition, classification, identification, prevalence, causes, characteristics and educational needs, including mainstreaming in the regular classroom.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (478,36,'B323','Intro Exercise and Sports Scie','(Prereq: BIO243 Anatomy and Physiology I and BIO244 Anatomy and Physiology II) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (479,40,'B202','Intro Front-End Web Developmen','{�CSCI B202} (Prerequisite: CSCI B145 and B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS) essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model.',3,NULL);
