INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (536,53,'B110','Introduction to Logic I','This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic, sentential logic, and predicate logic. Student will develop skills in the development and analysis of syllogisms, Venn Diagrams, truth tables, and formal proofs.',3,NULL);
