INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (544,9,'B495','Introduction to Sustainability','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course introduces students to the principles of sustainability as they apply to the environment, economy and social issues. The course format will primarily be interactive classroom experiences and experiential exercises (i.e., hands-on, real-life activities and projects). Standard course materials will be supplemented by guest speakers drawn from our local community.',3,NULL);
