INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (559,51,'B410','Leading in Organizations','(Prerequisite: Acceptance to RN to BSN program or NURS B326 or permission of instructor) This course examines the organizational and care delivery models where nurses lead, manage, and follow. Human resource practices; legal, regulatory, and risk management functions; quality improvement and change management techniques; and delegation expectations of the nurse are examined. Students are introduced to organizational and leadership theories.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (560,56,'B302','Learning and Memory','(Prerequisite: PSYC B101). Applications and research regarding the acquisition and retention of knowledge, including concepts such as the neurobiological basis of learning and memory, classical and operant conditioning, episodic and semantic memory, working memory and social learning.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (561,42,'B250','Liberal Studies Internship','Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (562,9,'B448','Life and Death in Salt Marsh','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Intensive Summer May Term course teaching field research methods, statistical design, and culminating in an independent research project on aspects of ecological processes of Beaufort and surrounding counties. Students will spend more than 5 hours per day in classroom/field-laboratory context planning, developing, researching background, and carrying out their research project, approved and facilitated by course faculty.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (563,56,'B321','Life Span Developmental Psyc','(Prerequisite: PSYC B101) Psychological development from conception to late adulthood. Topics include physical, cognitive and social processes associated with development at each stage of the life cycle.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (564,57,'B322','Life-Cycle Nutrition','(Prerequisite: HRTM/PUBH B242) This course examines the essentials of human nutrition and the modification of nutritional needs at different life stages, including pregnancy, lactation, infancy, childhood, adolescence, adulthood, and older adulthood.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (565,45,'B230','Linear Algebra','(Prerequisite: MATH B141 or consent of instructor) Linear systems and matrices, vector spaces, linear independence, rank of a matrix, linear transformations, determinants, introduction to eigenvalues and eigenvectors, diagonalization and applications. Offered Fall semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (566,60,'B407','Lit Tend Mstrpc Spanish Am II','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from Independence to present day. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (567,60,'B404','Lit Tend Mstrpcs of Spain I','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the Middle Ages to the 17th century. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (568,60,'B405','Lit Tend Mstrpcs of Span Am I','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from the Pre-Columbian Era to Independence. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (569,60,'B406','Lit Tend Mstrpcs Spain II','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the 18th century to present day. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (570,24,'B450P','Lit/Social St Practicum I','(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDRD B420 and EDRD B430 or B433). Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning, assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (571,24,'B428','Literacy Content for Teachers','(Prerequisite: Admission to the Professional Program or special permission of the Department Chair and EDCI B100, EDCI B243, and EDRD B318) This course is designed to instruct teacher candidates, grades pre-K through 6, in developing methods and materials that will improve their students� literacy skills in content area reading and writing. Offered in Fall.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (572,26,'B432','Literature for Young Adults','(Prerequisite: ENGL B101 or B105 & B102 or B106, and one literature course at the 200-level or higher, each with a grade of ''C'' or higher) Literature written for and about adolescents, examined through the critical lenses of psychological development, pedagogy, and publishing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (573,60,'B398','Love Sucks (Taught in English)','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of �C� or better in SPAN B202, or consent of instructor. Department consent required for transfer students.) Intensive study of selected topics of the Hispanic world. May be repeated for credit under different topic title. Taught in English.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (574,64,'B200','Lowcountry Studies Honors Sem','This seminar will be an introduction to topics, information, reading, and class field trips to reflect the Lowcountry Studies Honors'' experience in the first year of the program. Topics covered will include common readings, discussion of current topics or current events, and professional development of the student. Course can be taken for credit up to two semesters.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (575,34,'B300','Macro Level HMSV Interventions','(Prerequisite or co-requisite: HMSV B280 or consent of Instructor) Exploration of the theories, skills and practices of working with larger groups in human service settings such as grassroots or formal organizations, neighborhoods, communities, geographic regions, political jurisdictions, and societies. Includes community organizing and development, agency collaborations, social change, social marketing and public awareness, advocacy and social policy work. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (576,15,'B222','Macroeconomics','Macroeconomic analysis: basic definitions and concepts: mechanics of pricing and the fundamentals of American capitalism; national income economics, income and employment theory and monetary and fiscal policy.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (577,37,'B312','Mangement by Menu','(Co-requisite: HRTM B311 and B270 - all three must be taken together).Analysis, pricing constraints and mechanics of the menu.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (578,9,'B475','Marine Ecology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Structure, dynamics and interactions between populations and communities in marine ecosystems. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (579,9,'B475L','Marine Ecology Laboratory','(Prerequisite or Co-requisite: BIOL B475) Laboratory and field exercises in coastal environments.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (580,9,'B401','Marine Internship','(Prerequisite: Sophomore standing) Required paid or unpaid internship or field experience for gaining practical experience in marine biology.',0,3);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (581,9,'B490','Marine Policy','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course is an overview of strategies and current practices in marine and coastal policy and management and will examine relevant historical and current state, federal and international marine and coastal policy programs and issues. Students will learn directly from professionals in government, academia and non-governmental organizations and stakeholders. Specific emphasis will be put on science communication to policymakers in current issues. This course will be heavily activity-based.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (582,13,'B799','Master''s Thesis','Preparation of a thesis for the master''s degree. Repeatable as needed, with approval from the Computer Science department chair.',3,6);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (583,17,'B435','Math Experiences in ECE','(Prerequisite: EDCI B100; Admission to the Professional Program in Education or consent of the Department Chair; Co-requisites: EDEC B436, EDEC B444, EDEC B440P). This methods course includes the basic content of the academic area of mathematics to be presented to PreK-3rd grade children. Developmentally appropriate experiences, learning activities, materials and equipment to aid in the development of math concepts in young children are presented. Diversity-related influences and needs of exceptional learners are also addressed.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (584,45,'B421','Math for Secondary Teachers','Survey of properties and algebra of real numbers and complex numbers; properties and representations of various functions; concepts of calculus; Euclidean and non-Euclidean geometries; applications of probability, data analysis, and discrete mathematics.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (585,45,'B172','Math Modeling for Life Science','(Prerequisite: Grade of �C� or better in MATH B122 or MATH B141) Modeling with difference equations; vectors, trigonometry, polar coordinates, matrices, eigenvalues and eigenvectors; addition and multiplication in combinatorics, permutations, combinations, introduction to probability theory (discrete, continuous); techniques of integration, symmetry. Credit may not be received for both MATH B172 and either MATH B170 or B174. Offered Spring semester.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (586,16,'B111','Math Prep for Praxis Core','This course prepares education majors for the Praxis Core Mathematics exam (ETS Test Number: 5733). It equips each student with mathematical concepts and skills necessary to pass the Praxis Core Mathematics exam.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (587,18,'B440P','Math/Science Practicum','(Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEL B431, EDEL B432, and EDEL B434) Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (588,45,'B419','Mathematical Modeling','{� CSCI B419} (Prerequisite: grade of �C� or better in MATH B142 and CSCI B104, or consent of instructor) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (589,11,'B306','Media 2.0','This course explores the changing environment of traditional production and distribution of media by examining theories of new media distribution and specific cases of social media producers. Includes the production and distribution of students'' original work on the Internet.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (590,11,'B240','Media and Society','An introduction to the history, evolution and cultural impact of traditional and digital platforms, enabling students to develop a critical perspective of media content.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (591,44,'B102','Media Design','Fundamental conceptual and technical aspects of designing popular media, including an introduction to digital compositing, time-based media, and interactive media.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (592,3,'B452','Medical Anthropology','(Prerequisites: Sophomore standing or higher) Socio-cultural factors in health, illness, healing and in medical systems. Crosscultural and ethnographic evidence for public health research and program applications. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (593,9,'B461','Medical Parasitology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Corequisite: BIOL B461L) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites with emphasis on parasites that are of medical or veterinary importance.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (594,9,'B461L','Medical Parasitology Lab','(Prerequisite: BIOL B302 & B303. Corequisite: BIOL B461) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites and develop laboratory skills in parasite identification and morphology.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (595,51,'B412','Mental Health Nursing','(Prerequisite: NURS B320 and NURS B350; Pre or Co-requisite: NURS B360) This course focuses on the epidemiology and treatment of individuals with actue and chronic mental and addiction disorders across the lifespan. Bio-physical, genetic and environmental predisposition to these conditions are examined. Pharmacologic approaches are reviewed, with emphasis on maintaining drug therapy and alleviating side effects. Cognitive approaches to helping patients and families manage anxiety, fear, and self-doubt are addressed.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (596,34,'B282','Mezzo Level HMSV Interventions','(Prerequisite: HMSV B280 or consent of Instructor.) Exploration of the theories, skills and practice of working with small groups in human services settings. Includes understanding group dynamics, managing and facilitating educational and prevention groups, self-help and support groups, and families. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (597,47,'B390','Mgmt Information Systems','(Prerequisite: MGSC B290 or CSCI B101) A study of the concepts, interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems, collecting and processing data, reporting results of operations and controlling the business organization.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (598,46,'B473','Mgmt Operations of Small Bus','(Prerequisites: MGMT B371) Analysis of the management and operations of a small business. The course includes the study of an existing small business. The areas of management, finance, marketing and credit as they apply to a small business are studied.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (599,34,'B280','Micro Level HMSV Interventions','(Prerequisite or co-requisite: HMSV B190 or consent of Instructor.) Exploration of the theories, skills and practices of working one-on one in human services settings. Includes active listening, communication skills, and interviewing techniques, the development of service plans, crisis intervention, short and long term care, case management and information and referral services. Multicultural and ethical/legal issues related to this level of intervention will be examined.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (600,9,'B230','Microbiology','(Prerequisite: college-level biology) An introduction to bacteria and viruses, emphasizing structure, metabolism and pathogenesis. Discussion of infectious diseases, antigen-antibody relationships and anti-microbial agents in chemotherapy. Not available for biology major credit. Three lecture and three laboratory hours per week.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (601,15,'B221','Microeconomics','(Prerequisite: MATH B111 with a grade of �C� or higher) Microeconomic analysis theory of the firm, market structure, cost and output determination; market pricing; income distribution and international economics.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (602,59,'B355','Minority Group Relations','Theories, methods and substantive issues in the study of majority-minority group relations and social processes and cultural orientations associated with racial and ethnic differentiation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (603,48,'B454','Mktg Communications Strategy','(Prerequisite: MKTG B350) Integration of advertising, sales promotion, and point-of-purchase communications toward the goal of enhancing brand equity.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (604,48,'B465','Mkting Strategy and Planning','(Prerequisite: MKTG B352) Management of marketing organizations and integration of functions, with emphasis on planning and designing strategies and applying tools and techniques for problem solving and decision making.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (605,13,'B250','Mobile Application Development','{�ISAT B250} (Prerequisite: CSCI 145 with grade of C or better, or consent.) Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (606,13,'B450','Modeling and Simulation','{�ISAT B450} (Prerequisite: [STAT B240 or STAT B340] and CSCI/ISAT B350 or consent of instructor). An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (607,26,'B450','Modern English Grammars','Major structures of English morphology and syntax; role of language history and social and regional variation in understanding contemporary English.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (608,33,'B421','Modern Latin America','Traditional society in the area and problems arising from social, economic and political changes since independence; comparative studies of national responses to these problems.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (609,9,'B480','Molecular Marine Ecology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Investigation of techniques and analysis of molecular data in marine organisms. Hands-on experience using molecular tools to investigate population genetic, ecological and systematic principles.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (610,15,'B301','Money and Banking','(Prerequisites: ECON B221, B222) The role of money in the market economy. Commercial banks, the Federal Reserve System and monetary policy.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (611,44,'B410','Narrative Media','(Prerequisite: MART B310 or permission by instructor) Advanced project-based course on telling a story through moving pictures, including taking a script through the 3D production process to a festival quality short animation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (612,9,'B435','Neurobiology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (613,9,'B435L','Neurobiology Laboratory','(Prerequisite: BIOL B302 and consent of instructor) Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. One 3-hour laboratory per week.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (614,53,'B301','Nineteenth-and 20th C  Phil','An introduction to Continental and British philosophy since Kant through study of the works of representative philosophers. Particular emphasis is placed on the development of Idealism, Marxism, Existentialism and Phenomenology and analytic philosophy.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (615,34,'B402','Nonprofit Management & Funding','(Prerequisite: HMSV B400 or consent of Instructor) Principles, theories, skills and practices of effective nonprofit management, including the following topics: governance, legal structures and standards, strategic planning, fundraising and proposal development, volunteer management, marketing and communication.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (616,3,'B333','North American Prehistory','Prehistoric anthropology in North America from the first arrival of man through the beginning being of European acculturation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (617,45,'B427','Numerical Analysis','(Prerequisite: MATH B280 or B242, and MATH B230) Interpolation and approximation of functions; solution of algebraic equations; numerical differentiation and integration; numerical solutions of ordinary differential equations and boundary value problems; computer implementation of algorithms.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (618,13,'B502','Numerical Analysis & Computing','{�MATH B502} (Prerequisite: CSCI B280 and MATH B240 [or demonstrated equivalent knowledge/experience], or consent of instructor) Application of tools and techniques to algorithmic problems arising in discrete applied math. Topics include probabilistic methods, entropy, linear algebra methods, risk analysis, approximation and optimization techniques, and performance analysis.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (619,51,'B357','Nurs Concepts in Adult Health','(Prerequisite: Junior Standing) This class will help bridge an identified learning gap between NURS B326 and NURS B425.  The class will reinforce knowledge and application in Adult Health Nursing using a concept-based approach. The content will focus on critical thinking and clinical judgement utilizing the nursing process.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (620,51,'B100','Nursing Honors Seminar','(Prerequisite: Acceptance to the BSN Honors Program) This honors course is designed to provide students the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meetings and planned excursions will facilitate scholarly exploration of the practice of nursing, with an emphasis on the factors influencing current and future nursing practice.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (621,51,'B101','Nursing Honors Seminar II','(Prerequisite: NURS B100) This honors course is designed to provide students with the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meeting and planned excursions will facilitate scholarly exploration of the scope of practice including direct care roles and indirect care roles of the nurse and their influence on health policy and the health of populations across the nation.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (622,51,'B200','Nursing Honors Seminar III','(Prerequisite: NURS B101) This honors course is designed to provide students the opportunity to explore changing role of nursing across the globe. Seminar meetings and planned excursions will facilitate scholarly exploration of nursing practice, comparing and contrasting nursing practice in developed and developing countries with the United States. Emphasis is placed on the social determinants of health that influence disease prevention and health.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (623,51,'B201','Nursing Honors Seminar IV','(Prerequisite: NURS B200) This honors course is designed to provide students the opportunity to explore the changing role of nursing to improve the health of others. Through seminar meetings and experiential leaning, students will pursue a scholarly exploration of the healthcare system and health needs of populations at the regional, state, national or international level, culminating in a service-learning project focused on the leading health indicators of the Centers for Disease Control and Prevention (CDC) Healthy People 2020.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (624,51,'B350','Nursing Research','(Prerequisite: STAT B201 and NURS B202 or RN Licensure or consent of Instructor) The science of nursing is presented exploring how research builds the nursing profession. The research process, from question to study design and analysis, and onto field-based implementation is contrasted. Students are exposed to multiple studies sufficient to inform evidence-based practice and discern good from bad science. Discussion of institutional databases available to inform quality improvement and organizational policy is explained. Ethical concerns and the mitigation of research risks are considered.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (625,57,'B242','Nutrition','{�HRTM B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (626,37,'B242','Nutrition','{�PUBH B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (627,57,'B328','Nutrition & Chronic Disease','(Prerequisite: HRTM/PUBH B242) Explore the relationship of food, diet and lifestyle choices to the prevention and management of various chronic diseases. Main topic areas include type 2 diabetes, cardiovascular disease, digestive health, obesity and cancer.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (628,40,'B145','Object-Oriented Program I','{�CSCI B145} (Prerequisite: C or better in MATH B111 or higher or consent) Problem solving, algorithmic design, and programming. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (629,13,'B145','Object-Oriented Programming I','{�ISAT B145} (Prerequisite: C or better in MATH B111 or higher or consent) Problem solving, algorithmic design, and programming. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (630,40,'B146','Object-Oriented Programming II','{�CSCI B146} (Prerequisite: CSCI/ISAT B145) Continuation of CSCI/ISAT B145. Rigorous development of algorithms and computer programs; elementary data structures. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (631,13,'B146','Object-Oriented Programming II','{�ISAT B146} (Prerequisite: CSCI/ISAT B145) Continuation of CSCI/ISAT B145. Rigorous development of algorithms and computer programs; elementary data structures. Open to all majors.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (632,49,'B210','Oceans and Man','A non-technical introduction to the oceans: organisms, systems and the physical and chemical characteristics. Laboratories illustrate the structure and function of marine environments. Three lecture and two laboratory hours per week. Attendance on field trips may be required.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (633,49,'B210','Oceans and Society','A non-technical introduction to the oceans: organisms, systems and the physical and chemical characteristics. Laboratories illustrate the structure and function of marine environments. Three lecture and two laboratory hours per week. Attendance on field trips may be required.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (634,46,'B475','Operations & Supply Chain','(Prerequisites: MGMT B371 and STAT B201) A study of the strategic, operating and control decisions involved in manufacturing and service organizations. Topics include forecasting, process development, production technology, resource allocation, facility planning, facility layout, planning systems, inventory systems, resource requirements planning systems, shop floor planning, scheduling operations, just-in-time manufacturing, materials management, productivity control, quality management, quality control, project management and lean Six Sigma.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (635,29,'B202','Oral Communication','(Prerequisite: FREN B201 or by placement) Practice in conversation involving authentic materials; vocabulary building at the intermediate level.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (636,60,'B202','Oral Communication','(Prerequisite: SPAN B201, score on placement exam or consent of instructor, SPAN B202 is a continuation of SPAN B201). Review and further expansion of oral and written communication skills, reading of authentic materials and understanding of cultural and social topics, including Hispanics and Latinx in the United States. Intermediate language course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (637,60,'B201','Oral Expression & Career Build','(Prerequisite: SPAN B102, by placement exam or consent of instructor, SPAN B201 is a continuation of SPAN B102): Review and further expansion of productive and receptive language skills with a special emphasis on oral communication and grammar structures in the context of career building and professions at the intermediate level.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (638,63,'B340','Oral Interpredtation of Lit','{�COMM B340} A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (639,16,'B442','Org & Management in Secondary','(Prerequisite: Admission into the Professional Program) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse secondary classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorist and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, ABC Analysis, and the promotion of learning communities are components of this course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (640,16,'B441','Org Mgmt in Diverse Classroom','(Prerequisite: Admission to the Department of Education''s Teacher Education Professional Program for Elementary Education or Early Childhood Education) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, and the promotion of learning communities are components of this course.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (641,10,'B333','Organic Chemistry I','(Prerequisite: CHEM B112) Contemporary theories, nomenclature, reactions, mechanisms and syntheses of carbon compounds. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (642,10,'B334','Organic Chemistry II','(Prerequisite: Grade of C or better in CHEM B333, or with consent of instructor, CHEM B331) Continuation of CHEM B333. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (643,46,'B376','Organization Behavior','(Prerequisite: MGMT B371) A study of the process of integrating people into a work situation that motivates them to work together productively, cooperatively and with economic, psychological and social satisfaction.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (644,11,'B230','Organizational Communication','Fundamentals of oral communication within business and professional settings. Includes performance.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (645,6,'B210','Painting I','(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to painting that covers materials, techniques and related historical influences on the medium.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (646,6,'B310','Painting II','(Prerequisite: ARTS B102, B103, B104, B111, and B210) A continued exploration of the materials and techniques of painting with emphasis on individual creative expression.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (647,6,'B311','Painting III','(Prerequisite: ARTS B102, B103, B104, B111, and B310) Further development of technical and creative expression.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (648,51,'B310','Pathophysiology','(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor). Building on prior science courses, this course advances knowledge of pathophysiology by analyzing the molecular, cellular and organ system changes that occur with common diseases, noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (649,63,'B341','Performance of Caring','{�NURS B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (650,51,'B341','Performance of Caring','{�THEA B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (651,44,'B481','Performative Media','(Prerequisite: MART B381 or permission of instructor) Advanced project-based course on the design and practice of media performance, including the development of interactive virtual characters and environments for a live stage production.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (652,63,'B430','Performing Shakespear','(Prerequisite: THEA B170) This class helps students develop a mastery of methods that enable one to perform the works of Shakespeare with confidence and competence.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (653,22,'B231','Personal & Comm Health','(Prerequisite or Co-requisite: EDCI B100) A study of the principles and practices of personal and community health and their application to the health education of the young child.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (654,22,'B231','Personal and Community Health','(Prerequisite or Co-requisite: EDCI B100) A study of the principles and practices of personal and community health and their application to the health education of the young child.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (655,34,'B180','Personal and Professional Dev','(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor) This course provided students with the opportunity to explore their personal and professional development and understand how values, beliefs and norms impact both personal and professional lives.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (656,52,'B104','Personal Fitness & Weight Ctrl','Assessment of major fitness components and development of a personalized exercise program based on fundamental principles of exercise prescription. Weight management and dietary guidelines will be addressed.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (657,56,'B341','Personality Theory','(Prerequisite: PSYC B101) Covers the major theories and research on personality and the dynamics of human motivation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (658,59,'B378','Perspective in Public Sociolog','(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the ways sociologists contribute to issues on the public agenda through the interpretation and dissemination of sociological data and knowledge. Students will be introduced to practical and marketable skills for working as sociologists. Can include emphasis on the ways sociologists create tools, speak out, or write for a broad audience. May be repeated or taken simultaneously as topics vary. Variations will be announced in the schedule of classes by topic title.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (659,11,'B308','Persuasion & Social Influence','An in-depth exploration of the art and science of persuasion and social influence. Topics of study include definitions and models of persuasion, individual communicator characteristics important in the complex process of persuasion, conformity and influence in groups, persuasive language and nonverbal cues, principles of rhetoric and rhetorical devices, compliance-gaining communication, motivational appeals, deception, and the ethical dimensions of persuasion and social influence.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (660,51,'B320','Pharmacologic Interventions','(Prerequisite: NURS B310 or consent of instructor) Pharmacokinetics, pharmacodynamics and pharmacogenetics are studied from a drug classification typology. The nurse�s role in verifying and validating drug prescriptions, calculating dosages, administering will build previous learning. Assisting patients with the management of side effects, drug discontinuation, and iatrogenic complications are studied. Current issues with poly-pharmaceuticals, addiction, and self-management with over-the-counter and herbal usage will be discussed from an evidence- and ethically-based practice perspective.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (661,53,'B313','Philosophy of Art','Philosophical problems relating to the arts, with emphasis on questions pertaining to aesthetic experience.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (662,53,'B363','Philosophy of Film','{�IDST B363} (Prerequisite: ENGL B101/B105 and ENGL B102/B106) Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (663,53,'B315','Philosophy of Technology','This course will focus on the various philosophical questions and issues that arise from the technological opportunities and challenges of the 21st century. Philosophical topics surrounding technology will include those related to ethics, the philosophy of language, feminism, critical theory, and pragmatism. Possible topics regarding technology may include information technologies, robotics, AI, genetic engineering, cyborgs, climate change/geoengineering/the Anthropocene, and social media technologies. Finally, we investigate how technological developments stimulate philosophical thinking.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (664,54,'B101L','Physics How Things Work I Lab','(Prerequisite or Co-requisite: PHYS B101) Experiments, exercises and demonstrations to accompany PHYS 101.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (665,54,'B101','Physics of How Things Work I','A practical introduction to physics and science in everyday life� from concrete examples to basic physical principles.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (666,9,'B441L','Pinciples of Biochemistry Lab','{�CHEM B450L} (Prerequisite or Co-requisite: BIOL B441) Three laboratory hours per week.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (667,9,'B200','Plant Science','An introduction to plant science for the non-major. This course does not carry major credit and is not designed as a prerequisite for other biology courses. Plant development, physiology, genetics, evolution and ecology will be considered. Three lecture hours per week.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (668,9,'B200L','Plant Science Laboratory','(Prerequisite or Co-requisite: BIOL B200) Laboratory exercises, demonstrations and audiovisual supplements to BIOL B200. Two hours per week. Not for major credit.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (669,63,'B322','Playwriting','{� ENGL B322} (Prerequisite: Junior level or consent of instructor) A workshop approach to playwriting that culminates in each student creating a production-ready one-act play. May be repeated with consent of instructor for a maximum of 6 credit hours.',3,NULL);
