INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (672,56,'B409','Positive Psychology','(Prerequisite: PSYC B101 and Junior or Senior standing) Research and theories on psychological well-being and happiness. Topics include subjective well-being, positive affect and emotions, flow, resilience, correlates of happiness, self-regulation, virtues and character, interpersonal relationships, and mindfulness.',3,NULL);
