INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (674,13,'B500','Practical Computing for Comp S','(Prerequisite: Enrollment in CSCI M.S. program OR consent of instructor) Application of mathematical, science, and engineering problems to software engineering. Introduction to operating systems including UNIX/LINUX.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (675,37,'B290','Practicum','Supervised full-time work experience in an area of the hospitality industry, selected by the student and approved by the practicum coordinator.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (676,17,'B440P','Practicum II','(Prerequisite: Admission to the Professional Program or consent of the Department Chair; Co-requisite EDEC B435, EDEC B436, and EDEC B444). Supervised clinical experience in an early childhood setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades P-3. Offered in Fall.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (677,18,'B440P','Practicum II','(Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEL B431, EDEL B432, and EDEL B434) Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (678,24,'B450P','Practicum II: Teaching Readers','(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDRD B420 and EDRD B430 or B433). Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning, assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (679,24,'B640P','Practicum in Assessing & Teach','(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning, assessing, and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (680,21,'B430P','Practicum in Teaching Math Sec','(Co-requisite: EDME B430) Supervised clinical experience in a secondary mathematics setting. Observation and participation in a classroom setting is required.',3,NULL);
