INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (682,45,'B115','Precalculus Mathematics','(Prerequisite: Qualification through placement or a grade of �C� or better in B111) Topics in algebra and trigonometry specifically needed for MATH 141, 142, 240. Polynomial, rational, inverse, logarithmic, exponential functions; circular functions; analytic trigonometry. Offered every semester.',4,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (683,64,'B150','Pre-Nurs Student in the Univ','University 150 is designed to help first-year pre-nursing students understand and adjust to the demands of the nursing major, acquire essential academic success skills to be successful, and better understand the nursing field as well as adjacent vocations.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (684,3,'B101','Primates, People and Prehist','An exploration of human origins, human evolution, human prehistory and cultural existence from its less complex forms to early civilizations. An introduction to the concepts, methods and data of physical, biological and archaeological anthropology. May be taken with, or independently of, ANTH B102. Satisfies 3-credit hour course requirement for Natural Science GE.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (685,37,'B311','Princ Food Service Sanitation','(Co-requisite: B312 and B270 - all three must be taken together).Business and regulatory practices relevant to a sanitary food service environment.',1,NULL);
