INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (700,46,'B475','Production/Operations Mgmt','(Prerequisites: MGMT B371 and STAT B201) A study of the strategic, operating and control decisions involved in manufacturing and service organizations. Topics include forecasting, process development, production technology, resource allocation, facility planning, facility layout, planning systems, inventory systems, resource requirements planning systems, shop floor planning, scheduling operations, just-in-time manufacturing, materials management, productivity control, quality management, quality control, project management and lean Six Sigma.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (701,37,'B245','Prof Dev Hospitality Mgmt','Course focuses on preparing students for successful job searches and thriving in entry-level management positions in the hospitality industry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (702,51,'B410','Prof Nurs Leadership and Mgmt','(Prerequisite: Acceptance to RN to BSN program or NURS B326 or permission of instructor) This course examines the organizational and care delivery models where nurses lead, manage, and follow. Human resource practices; legal, regulatory, and risk management functions; quality improvement and change management techniques; and delegation expectations of the nurse are examined. Students are introduced to organizational and leadership theories.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (703,51,'B410','Professional Nurs Leadership','(Prerequisite: Acceptance to RN to BSN program or NURS B326 or permission of instructor) This course examines the organizational and care delivery models where nurses lead, manage, and follow. Human resource practices; legal, regulatory, and risk management functions; quality improvement and change management techniques; and delegation expectations of the nurse are examined. Students are introduced to organizational and leadership theories.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (704,51,'B435','Professional Nursing Seminar','(Prerequisite: NURS B412, B418, & B422C) Students will prepare a personalized career plan that is consistent with an intentional career focus. Documents needed to apply for licensure, jobs, and continuing education will be developed and refined. Interviewing skills needed for applying for jobs and graduate level education are rehearsed. The use of social media in job procurement is presented. Readiness for NCLEX-RN� and achievement of licensure will be emphasized.',2,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (705,26,'B460','Professional Writing Workshop','(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher.) Upper-division writing workshop course, focusing on the study and practice of professional writing. Course may be taken twice for credit.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (706,26,'B490','Professionalization in English','(Prerequisite: Senior standing in English or department approval) A professional development course connecting the knowledge, skills, and experiences of the English major to advanced exploration of and active preparation for opportunities after graduation.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (707,56,'B322','Psyc of Child Development','(Prerequisite: PSYC B101) Examination of development from conception through older childhood. Specific cognitive and social processes will be given in-depth study.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (708,56,'B418','Psyc of Drug Use and Effects','(Prerequisite: PSYC B101) Overview of the physiology and psychological effects of psychoactive substances and of addictions.  Historical, societal, legal, medical, and economic factors on psychoactive substance use and abuse will be explored.',3,NULL);
