INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (717,56,'B441','Psycl Tests and Measurement','(Prerequisite: STAT B201 or consent of instructor) Overview of the nature, design and application of psychological tests. Emphasis on test construction, the psychometric properties of psychological tests, intelligence and aptitude testing, objective and projective tests of personality and general issues in the application of tests.',3,NULL);
