INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (812,60,'B400','Spanish Civilization I','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of �C� or better in SPAN B202, or consent of instructor.) Lectures, readings and visuals on Spanish civilization and its cultural heritage from the Middle Ages to 1700. Taught in Spanish.',3,NULL);
