INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (814,16,'B599','Special Topics in Education','(Prerequisite: Permission of Instructor) Introduction to topics in education. Course content varies and will be determined by instructor.',1,3);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (815,37,'B498','Special Topics in Hospitality','Advanced concepts, issues and trends in the hospitality and tourism industry. Variable hours between 1-3 credits. May be repeated for up to 6 credit hours.',1,6);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (816,51,'B499','Special Topics in Pro Nursing','(Prerequisite: NURS B326 or B301 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidenced-based practice changes in professional nursing practice. Variable hours between 1-3 credits, depending upon special topic. Topics may include complementary and alternative health practices, end-of-life and palliative care, working with special populations, and nursing theories. May be repeated under different topics.',1,3);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (817,57,'B499','Special Topics in PUBH','(Prerequisite: PUBH B310 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4credits, depending on special topic. Topics may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits.',1,4);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (818,40,'B409','Special Topics in Security','(Prerequisite: Consent of instructor) Intensive study of a particular topic in computing security, information security, or other aspects of cybersecurity. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (819,51,'B305','Spirituality, Health & Profess','(Prerequisite: NURS B202 or PUBH B315) Exploration of spirituality, its effect on health, and health professionals roles in the spiritual care of clients.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (820,61,'B320','Sport Law','This course provides a broad outline of basic legal concepts in the context of recreation and sport at all levels, professional and amateur. As such, students will be introduced to legal structures, case law, sport-related court cases, and legal precedents. Upon completion of this course, students will have a basic understanding of the legal issues that directly impact the sport industry and will be able to demonstrate an understanding of the law as it applies to professional and amateur sports.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (821,56,'B229','Sport Psychology','The role of sports in socialization, personality development and competence, including: spectator-performer interactions, motivation, competition effects; and the application of psychological techniques to performance enhancement.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (822,38,'B325','Sports & The Humanities','Analyzation of the role of sports in the humanities. Emphasis on social and cultural importance of sports in humanistic study.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (823,11,'B402','Sports Broadcasting','The course provides a strong foundation into the field of sports broadcasting. Students will explore the key issues that drive the sports broadcasting industry and will participate in the production of sports broadcasting.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (824,48,'B474','Sports Marketing','(Prerequisite: MKTG B350) A study of promotion, sales, and sponsorship strategies utilized in both the marketing of sports (events and properties) and marketing through sports (building brands via alignment with a sports property).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (825,37,'B320','Sports Nutrition','{� PUBH B325} (Prerequisite: PUBH/HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates, fats, proteins, vitamins, minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes, how to measure body composition, and the use of and controversy over ergogenic aids are explored.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (826,57,'B325','Sports Nutrition','{�HRTM B320} (Prerequisite: PUBH/HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates, fats, proteins, vitamins, minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes, how to measure body composition, and the use of and controversy over ergogenic aids are explored.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (827,52,'B148','Stand Up Paddle Boarding','(Prerequisite: Must be a deep water swimmer.) A supervised calm water stand up paddling experience. Emphasis on safety, equipment selection, paddle and board-handling techniques, fitness, travel safety, rescue and survival techniques.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (828,14,'B200','Statics','(Prerequisite: MATH B142) Principles of computational mechanics; equilibrium of particles and rigid bodies; distributed forces, centroids, and centers of pressure, mass, and gravity; moments of inertia; analysis of simple structures and machines.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (829,56,'B201','Statistics Lab in Psychology','(Prerequisite or Co-requisite: STAT B201 or permission from instructor) Psychological experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (830,11,'B345','Storytelling in Contexts','(Prerequisite: COMM B140) This course analyzes the role of storytelling in everyday life. A variety of contexts will be examined and students will study storytelling techniques and use these to tell stories.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (831,46,'B478','Strategic Management','(Prerequisites: MKTG B350, BADM B363, MGMT B376 and Senior standing) A study of the strategic management process and of the formulation and application of functionally integrated business policy by top management. Emphasis is on decision-making in the face of changing conditions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (832,11,'B306','Strategic Social Media','This course explores the changing environment of traditional production and distribution of media by examining theories of new media distribution and specific cases of social media producers. Includes the production and distribution of students'' original work on the Internet.',3,NULL);
