INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (837,13,'B550','Systems Modeling & Simulation','(Prerequisite: CSCI B500, B501, and B502, or consent of instructor) Introduction of computational tools, models, system dynamics, input and output analysis, and performance analysis.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (838,18,'B432','Tching Science Elementary Schs','(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching science in an inquiry format to diverse learners in grades 2-6. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (839,18,'B443','Tching Social Studies in Elem','(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching social studies to grades 2-6 for learners to become well-informed citizens in a culturally diverse and democratic society. Included are supervised practicum experiences that promote reflective teaching in the elementary school setting.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (840,18,'B431','Teach Math in Elementary Schls','(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching mathematics to diverse learners in grades 2-6. Problem solving, mathematical content and process connections, as well as assessment, diagnosis, and remediation will be addressed. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (841,16,'B201','Teacher Cadet II','(Prerequisite: EDCI B100) This course focuses on the dynamics of human learning and the psychological principles that serve as the foundation for educational practice. The general goal is to provide a basic introduction to research findings from the discipline of psychology that can be used to inform the planning and implementation of effective instructional practices in the classroom.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (842,21,'B430','Teaching Math in Secondary Sch','(Co-requisite: EDME B430P) This course includes teaching methods for secondary mathematics education.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (843,17,'B438','Teaching Soc Stu in Early Chil','(Prerequisite: Entry into the Education Professional Program; Corequisite: EDRD B450P) This course provides an in-depth study of methods and materials used for teaching social studies to early childhood students (grades PreK-3). Emphasis will be on the use of a variety of instructional strategies to meet the diverse needs of elementary students based on effective research-supported ways to differentiate instruction, as well as how curriculum can be extended, accelerated, and enriched for the College, Career, and Civic Life (C3) Framework for Social Studies State Standards.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (844,26,'B462','Technical Writing','(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher.)Preparation for and practice in types of writing important to scientists, engineers and computer scientists, from brief technical letters to formal articles and reports.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (845,13,'B350','Techniques of Computation','{�ISAT B350} (Prerequisite: CSCI/ISAT B146) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (846,11,'B405','Television Studio Prod II','(Prerequisite: COMM B305 or instructor permission) This course is devoted to learning advanced techniques of television studio production. Students will extend previously learned skills of television studio production and will individually produce television shows to be aired on local outlets.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (847,11,'B305','Television Studio Production I','This course is devoted to learning the techniques of television studio production. Students will learn preproduction planning, script development, lighting design, audio design, the art of three studio-camera shooting, technical directing and studio television directing.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (848,52,'B121','Tennis I','Introduction to the game of tennis. All aspects of the game for new players including technical, tactical, physical and mental skills will be developed. The emphasis will be on helping students serve, rally and score and to build their knowledge and skill base.',1,NULL);
