INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (888,60,'B375','TopicsHispanic Cults and Lit','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of �C� or better in SPAN B202 or consent of instructor. Department consent required for transfer students.) Course content varies and will be announced in the schedule of classes by topic title. May be repeated once for credit. Taught in Spanish.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (889,45,'B460','Topology','(Prerequisite: grade of �C� or better in MATH B300 or consent of instructor) Topological spaces and homeomorphisms; separability; compactness; connectedness; completeness; metrizability; introduction to homotopy theory.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (890,37,'B280','Tourism','Economic and social relationships between tourism and the hospitality industry.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (891,26,'B420','Transatlantic Literature','(Prerequisite: ENGL B101 or B105 & B102 or B106, and one literature course at the 200-level or higher) A study of transatlantic literature, focusing on exchanges, networks, triangulations among writers, and reading practices that challenge national critical and historical traditions.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (892,36,'B300','Transcultural Health','This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a unique perspective on the implications for patient care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (893,51,'B330','Transcultural Health','(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course focuses on the health practices of individual, family and communities with varied cultural, socioeconomic, and global backgrounds. Cultural variables such as age, gender, ethnicity, family structure, spiritual practice and religion, sexual expression, economics, and common health practices are examined to sensitize providers to person-centered care. Cultural practices in birth, health, pain management, natural healing practices, illness and death are explained and reinforced.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (894,51,'B330','Transcultural Health Practices','(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course focuses on the health practices of individual, family and communities with varied cultural, socioeconomic, and global backgrounds. Cultural variables such as age, gender, ethnicity, family structure, spiritual practice and religion, sexual expression, economics, and common health practices are examined to sensitize providers to person-centered care. Cultural practices in birth, health, pain management, natural healing practices, illness and death are explained and reinforced.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (895,56,'B413','Trauma & Recovery','(Prerequisite: PSYC B311 or equivalent) This course will provide an overall theoretical basis for trauma assessment and intervention. Students will learn the overview of trauma & recovery from crime scene to therapy couch. Topics include legal, social, and behavioral concepts of trauma, trauma theory, treatment options, and stages of recovery.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (896,51,'B420','Trends and Issues in Nursing','(Prerequisite: NURS B356 and NURS B358 for pre-licensure students) Historical and present trends in nursing practice are taught in this course with a perspective on nursing education, genetic research, evidenced-based practice and complementary therapies (Lecture 3 hours).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (897,26,'B402','Tudor Literature','Poetry and prose of the 16th century.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (898,63,'B200','Understand and Appreciate Thea','An introduction to the understanding and appreciation of theatrical experience. Attendance at theatrical performances required. Appropriate for students from any discipline.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (899,3,'B102','Understand Other Cultures','An exploration and comparison of selected contemporary cultures, including their languages. An introduction to the concepts, methods and data of socio-cultural anthropology and anthropological linguistics. May be taken with, or independently of, ANTH B101. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (900,50,'B129','University Chorus','Musical organizations are open to all university students by audition. May be repeated for up to 8 credits.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (901,33,'B430','US Constitutional History','(Prerequisite: completion of one of the following: HIST B101, B102, B111, B112, B115, B116. Of the six, HIST B111, or B112 which cover U.S. history are preferred, though not required.)United States Constitutional history including constitutional origins in English and colonial legal practices, writing and ratifying the Constitution, Supreme Court decisions, and changes in constitutional interpretation into the twentieth century. Course includes REACH Act �Founding Documents�.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (902,26,'B412','Victorian Literature','Poetry and prose from the 1830s to the end of the century.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (903,44,'B281','Video Game Design 1','Introduction to the theory and practice of using computer software to design interactive digital media, including a first-person 3D video game.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (904,44,'B381','Video Game Design 2','(Prerequisite: MART B281) Intermediate project-based course on a specialized aspect of 3D video game production, including art assets, level design, or coding events.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (905,37,'B350','Wedding and Special Event Mgmt','This course provides an overview of producing weddings and other special events.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (906,9,'B290','Weekly Seminar in Science','(Prerequisite: Permission of instructor) Weekly seminar in science is a survey of scientific research seminars presented by both USCB researchers and visiting researchers from other institutions. Format is that of a departmental seminar. Grades are based on attendance and on a number of executive summaries of seminars by students taking the course for credit. Class can be taken up to 4 times under different semesters.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (907,52,'B105','Weight Training','An introduction to progressive resistance training and participation in a personalized strength training program with emphasis on proper technique and safety principles.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (908,52,'B106','Weight Training II','This course expands on skills learned in PEDU B105 (Weight Training I) and is designed to further students� knowledge of weight training principles and techniques. Students create a personalized weight-training program designed to build muscular strength, endurance and power. Instruction includes musculoskeletal anatomy and weight training strategies.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (909,64,'B102','Well-Being in the University','Well-Being in the University is designed to help first-year students who had experienced academic difficulties in their first semester better understand how their overall well-being impacts their success in college. Using a strengths-based approach, this course provides a general overview of the dimensions of wellness, helps students explore how their overall well-being effects their college success, and how they can use their strengths to overcome barriers to success in college.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (910,57,'B370','Wellness in Health Promotion','(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework; and HRTM B242) The study of the roles of nutrition, exercise, hygiene and rest in the prevention of disease and the achievement of optimal health.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (911,36,'B370','Wellness in Health Promotion','The study of the roles of nutrition, exercise, hygiene and rest in the prevention of disease and the achievement of optimal health.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (912,37,'B315','Wellness Trends in Hospitality','This course explores the concept of wellness and identifies key trends affecting the hospitality industry. Topics include the six dimensions of wellness.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (913,26,'B437','Women Writers','Representative works written by women.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (914,51,'B356','Women''s Health Nursing','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B358) This course addresses the primary and preventive care provided to childbearing families. The needs of reproducing families to ensure safe pre-, intra-, and postnatal outcomes are addressed to ensure growth and functioning in the family unit. Male reproductive and female gynecological norms and abnormalities, along with complications of pregnancy, are contrasted. Psychosocial adaptations and special needs of the family unit are studied to manage grief and loss, palliative care and women�s and men�s reproductive health challenges.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (915,33,'B301','Women''s History','An introduction to the concepts of Patriarchy and gender and their operation over time.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (916,59,'B403','Working with Older Adults','{�HMSV/PSYC B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (917,56,'B403','Working with Older Adults','{�HMSV/SOCY B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (918,34,'B403','Working with Older Adults','{�PSYC/SOCY B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (919,26,'B463','Workplace Writing','(Prerequisite: ENGL B101 or B105 and ENGL B102 or B106, each with a grade of C or higher) Advanced practice in the skills needed for effective workplace writing, with a focus on leading teams of writers, professional editing skills, and managing writing projects in a range of workplaces.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (920,6,'B100','Workshop for Non-Majors','Varied topics in Visual Art & Design for non-major students. This course will not count toward major or minor credit in Visual Art & Design, but would count toward elective credit, and could be repeated multiple times if in different areas.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (921,33,'B116','World History 1500 to Present','HIST 116 is the second of a two-semester survey of World History from the advent of the modern period (1500 C.E.) to the present. The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 116 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (922,33,'B115','World History to 1500','HIST 115 is the first of a two-semester survey of World History from the origin of human civilizations to the advent of the modern period (1500 C.E.). The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 115 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (923,26,'B270','World Literature','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of world literatures, spanning ancient to postmodern texts. Appropriate for students from any discipline.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (924,26,'B270','World Literatures','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of world literatures, spanning ancient to postmodern texts. Appropriate for students from any discipline.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (925,33,'B302','World of the Ancient Greeks','An examination of the political, cultural, and social history of ancient Greece, from the emergence of the Polis in the eighth century to the death of Alexander in 323 BCE.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (926,33,'B303','World of the Ancient Romans','An examination of the political, cultural, and social history of ancient Rome, from the founding of the city c. 750 BCE to the barbarian conquest in the fifth century.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (927,30,'B121','World Regional Geography','Introduction to the physical and human geography of the world with a focus on selected regions. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (928,59,'B315','Wrd Pop: Problems and Policies','World population growth and concomitant socioeconomic problems. Effectiveness of governmental policies concerned with population growth. Topics include over-population. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (929,11,'B210','Writing Across Media Platforms','(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of C or higher, and COMM B140 and COMM B190) Students will learn practical skills to help them succeed in writing for specifically online news environments. Emphasis is given to clear and effective communication and professional standards as well as the need to tailor the message to the audience and the platform through which it is communicated.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (930,24,'B626','Writing Across the Curriculum','This course is designed to instruct graduate candidates, grades k-12 in developing methods and materials that will improve their students� literacy skills in the content areas of math, social studies, science, and health. Emphasis is on the application of strategies that will support students in reading, writing, and working with media in the context of content area instruction.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (931,26,'B215','Writing Center Practicum','(Prerequisite: Grade of �B� or higher in ENGL B470 and Instructor Permission) Provides students with ongoing practice and training in teaching and tutoring writing. May be taken up to 6 times for credit.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (932,26,'B461','Writing in Health Professions','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a grade of ''C'' of higher.) Preparation for and practice in types of writing important to those working within the health care and public health industry, from brief letters to formal articles and reports.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (933,36,'B461','Writing in Health Professions','Preparation for and practice in types of writing important to those working within the health care and health promotion industry, from brief letters to formal articles and reports.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (934,57,'B461','Writing in the Health Professi','(Prerequisite: PUBH B310) Preparation for and practice in types of writing important to those working within the health care and public health industry, from brief letters to formal articles and reports.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (935,26,'B466','Writing Internship','(Prerequisite: Departmental permission.) (Can be repeated for a maximum of 6 credit hours.) Internship in writing, editing, proofreading, and/or research with a community organization or publication, with training in writing effectively for diverse audiences in a workplace setting.',1,6);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (936,16,'B110','Writing Praxis Core','(Prerequisite: Grade of ''C'' or better in ENGL B102) Review of the grammatical and writing concepts necessary for teachers at all levels, specifically those tested by the Praxis Core Writing exam.',1,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (937,38,'B320','Yoga Disciplines & Practice','(Prerequisite: Sophomore Standing) A broad introduction to the physical and philosophical practice of yoga. Examination of historical yogic texts and application of ideas in modern society via community outreach component.',3,NULL);
INSERT INTO Courses(CourseID,SubjectID,CourseNumber,CourseTitle,CourseDescription,MinCredit,MaxCredit) VALUES (938,52,'B136','Yoga I','Explore the mind-body connection through participation in yoga poses, transitional movements, and progressive relaxation techniques. Build strength, flexibility, muscle tone, and mindfulness while improving one''s sense of well-being.',1,NULL);
